  `forcex` tinyint(4) NOT NULL default '0',
  `dexterite` tinyint(4) NOT NULL default '0',
  `puissance` tinyint(4) NOT NULL default '10',
  `volonte` tinyint(4) NOT NULL default '10',
  `energie` tinyint(3) unsigned NOT NULL,
  `melee` mediumint(9) NOT NULL default '0',
  `esquive` mediumint(9) NOT NULL default '0',
  `incantation` mediumint(8) unsigned NOT NULL default '0',
  `sort_vie` mediumint(8) unsigned NOT NULL default '0',
  `sort_mort` mediumint(8) unsigned NOT NULL default '0',
  `sort_element` mediumint(8) unsigned NOT NULL default '0',
  `arme` varchar(10) NOT NULL,
  `action` text NOT NULL,
  `level` tinyint(3) unsigned NOT NULL default '0',
  `xp` mediumint(9) NOT NULL default '0',
  `star` mediumint(9) NOT NULL default '0',
  `drops` text NOT NULL,
  `spawn` int(10) unsigned NOT NULL default '0',
  `spawn_loc` text NOT NULL,
  `terrain` varchar(50) default NULL,
  `affiche` enum('y','n') NOT NULL default 'y',
  `description` text NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=127 DEFAULT CHARSET=utf8;
SET character_set_client = @saved_cs_client;

