INSERT INTO `monstre` VALUES (1,'lapin','Lapin','bete',60,0,1,8,12,10,10,10,10,12,0,0,0,0,'','',1,100,8,'o3-20',1500,'','1','y','Ces charmantes petites créatures batifolent dans les plaines a longueur de journée et sont les cibles \r\nprivilégiées de nombreux prédateurs. Leur taux élevé de reproduction leur permet néanmoins de survivre \r\net on en trouve toujours aux 4 coins des plaines.\r\n'),(2,'renard','Renard','bete',90,15,5,12,14,10,10,10,30,35,0,0,0,0,'','',2,300,15,'o3-20',1470,'','2','y','Prédateur rapide des plaines, le renard se nourrit principalement de rongueurs et fuit les bipèdes \r\ncomme la peste. Difficile à approcher, cet animal très malin peut parfois être croisé un camembert entre \r\nles canines. \r\n\r\n'),(3,'serpent','Serpent','bete',80,50,70,10,17,10,10,10,60,100,0,0,0,0,'','',3,600,30,'hg1-909;o21-40',1440,'','1','y','Longs animaux recouverts de fines écailles, les serpents sont des animaux discrets des plaines. \r\nEffrayés par les bipèdes, leur peur peut les pousser à l’attaque lorsqu’ils se retrouvent acculés. Certaines \r\nespèces sont venimeuses et leur morsure peut, selon les cas, provoquer  une mort lente ou rapide. \r\n\r\n'),(4,'loup_garou','Loup-garou','humanoide',800,300,400,20,17,10,11,11,250,300,0,0,0,0,'','#10°berzeker@_10;#09=3@_54;#09=4@_48;#09=5@_6;#09=6@_29',9,5000,338,'hg1-143;o8-190;o22-60;l29-130;l30-130;l41-70;l42-130',1260,'','2','y','Appelé lycanthrope dans certaines régions du monde de Starshine, les loups garous sont des \r\ncréatures nocturnes. Humanoïdes le jour, ces créatures perdent toute sociabilité la nuit pour se transformer \r\nen loups bipèdes, très intelligentes et dangereuses. Si les yeux d’un de vos amis, un soir de pleine lune, \r\nprennent une teinte jaune, n’attendez pas que ses ongles s’allongent pour se transformer en griffes, ou que \r\nses poils se transforment en toison… Faites lui une fleur et achevez le ! \r\n\r\n'),(5,'ours_noir','Ours Noir','bete',500,200,150,19,13,10,10,10,200,150,0,0,0,0,'','#09=10@_53;#10°berzeker@_10;#14<5@_47;!',5,1500,75,'hg1-263;o12-50',1380,'','1','y','Passant l’hiver à somnoler, l’ours noir peut être croisé dans les plaines au retour du printemps. \r\nPlacide face à la présence de bipèdes, il attaque néanmoins dès qu’il se sent menacé et sa charge \r\ninexorable peut s’avérer très dangereuse. Avide de miel, l’appâter afin de le terrasser peut s’avérer très \r\nfacile. \r\n\r\n'),(6,'araignee_geante','Araignée Géante','bete',700,150,170,19,17,10,10,10,200,250,100,50,50,50,'dague','#14<4µ#11°poison@~86;#13+poison@~135;#14<5@_12',7,2500,150,'hg1-179;o21-60;l10-70;l11-70;l20-70;l21-70;l22-70;l38-70;l40-130;l39-130;l51-130',1320,'','1','y','Si par mégarde vous rencontrez d’étranges filaments, épais comme le pouce et durs comme \r\nl’acier, translucides à la lumière du soleil, regardez autour de vous et vous aurez peut-être la chance \r\nd’apercevoir une araignée géante. La première réaction est souvent de prendre la fuite, mais il s’agit de la \r\npire erreur faisable : vous risqueriez alors de vous empêtrer dans sa toile et alors nulle échappatoire, \r\nhormis dans l’estomac de celle-ci. \r\n\r\n'),(7,'belette','Belette','bete',70,0,1,9,11,10,10,10,11,11,0,0,0,0,'','',1,120,9,'o3-20',1500,'','2','y','Petit animal carnivore à fourrure, on trouve généralement les belettes en forêt. On pourrait \r\ns’inquiéter de leur omniprésence étant donné leur caractère vorace, mais sa taille ridicule n’en fait un \r\nprédateur que pour les plus petits rongeurs et la cible de nombreux chasseurs de peaux. \r\n'),(8,'petit_scorpion','Petit Scorpion','bete',40,0,1,8,13,10,10,10,9,14,0,0,0,0,'','',1,150,8,'o21-40',1500,'','3','y','Habitant du désert de petite taille, le scorpion est très résistant à la chaleur et peu être trouvé en \r\ntout point du désert. Très prisé pour son venin qui est à la base du célèbre remède Scavenger contre la \r\ngueule de bois, il a apprit à se montrer discrets et se cache souvent sous le sable pour surprendre les \r\nvoyageurs imprudents.  \r\n\r\n'),(9,'guepard','Guépard','bete',260,100,90,13,16,10,11,11,100,150,0,0,0,0,'','_8;!',4,1000,45,'hg1-417;o20-45',1410,'','1','y','Félin svelte et rapide, le guépard est un mammifère discret et dangereux pour tous les herbivores \r\ndes plaines. Rare sont ceux qui arrivent à les chasser, ou même à les approcher tant ils sont véloces et \r\nleurs peaux, très prisées pour la confection de tapis et de vêtements,  sont donc revendues chèrement sur \r\ntous les marchés. \r\n\r\n'),(10,'pingouin','Pingouin','bete',70,0,1,8,12,10,10,10,8,8,0,0,0,0,'','',1,120,9,'o3-20',1500,'','4','y','Créature lente et pataude, elle fut menacée d’extinction après les jeux olympiques de Brisebois au \r\ncours duquel les barabares s’affrontèrent au lancé de pingouin. Depuis peu, ils  récupèrent leurs droits sur \r\nla banquise et peuvent désormais être trouvés en groupes à distance de la capitale. \r\n'),(11,'elementaire_air','Elémentaire d\'air','magique',760,400,600,18,20,10,12,12,250,400,0,0,0,0,'','#10°posture@_19;#14<5@_42;#14<5@_51;!',10,7000,750,'hg1-133;o22-80;o25-200;l15-70;l14-130;l16-130;l31-130;l33-130;l32-130;l43-130;l44-130;l45-130;l46-130;l47-130;l56-130;l57-130;l58-130;l59-130',1230,'','1','y','Créature brumeuse évoluant dans les plaines, l’élémentaire d’air a l’apparence d’un nuage quasi- \r\ntranslucide. Se nourrissant d’une simple brise, celui-ci peut prendre des dimensions hors du commun si il \r\nse sent menacé. Si d’aventure en vous promenant, vous trouvez que la consistance de l’air change autour \r\nde vous, qu’il devient en quelque sorte plus dense et plus palpable, prenez vos jambes a votre cou si vous \r\nen avez l’occasion : vous venez de rentrer dans un élémentaire d’air ! \r\n\r\n'),(12,'elementaire_eau','Elémentaire d\'eau','magique',760,350,300,20,18,16,16,16,300,350,300,15,15,150,'','#10°posture@~104;#14<3@~155;#14<5@~26;!',10,6000,443,'hg1-133;o22-90;l15-130;l14-130;l16-130;l32-130;l33-130;l31-130;l43-130;l44-130;l45-130;l46-130;l47-130;l56-130;l57-130;l58-70;l59-70',1230,'','4','y','Créature magique totalement constituée d’eau, cet élémentaire prend l’apparence d’une vague se \r\ntransformant lentement en une créature d’une quinzaine de pied de haut. Très difficile à repérer, \r\nl’élémentaire modèle son corps à volonté et est capable de prendre visage humain tout autant que celui \r\nd’une simple étendue d’eau. Faites donc très attention aux flaques d’eau sur la banquise, celles-ci auront \r\ntôt fait de se transformer en raz de marée ! \r\n\r\n'),(13,'cactus_geant','Cactus Géant','bete',760,200,200,22,15,10,11,11,250,200,250,130,0,0,'','#10°benediction@~87;#09=2@~80;#00<40@~21;#09=5@~115',8,3500,225,'hg1-159;l12-100;l13-70;l23-70;l24-130;l25-70;l26-70;l28-130;l27-70;l52-130;l54-130;l53-130;l55-130;l62-130',1290,'','3','y','Les voyageurs du désert sont souvent peu prévoyants et taillent les cactus pour obtenir l’eau qui \r\nleur manque. Il faut néanmoins prendre garde à ne pas approcher de trop près les cactus géants qui sont \r\ndoués d’une volonté propre. Essayez de le tailler pour voir, vous découvrirez alors dans la douleur que ses \r\népines sont très acérées. En cas de victoire néanmoins, vous pourrez avoir la joie de distiller leur eau pour \r\nproduire le célèbre alcool de cactus des Scavengers, mais il est sans conteste plus simple de passer à la \r\ntaverne d’Akéva… '),(14,'gargouille','Gargouille','magique',900,600,800,25,20,10,15,15,300,450,210,50,110,70,'','#11°paralysie@~19;#11°appel_tenebre@~66;#14<5@_42',12,10000,608,'hg1-167;hg2-10000;o26-210;l18-70;l19-130;l36-70;l35-130;l48-130;l49-130',1170,'','8','y','Créature monstrueuse née originellement dans l’esprit d’architectes. Statues de pierres ornant à \r\nl’origine les bâtiments, ces créatures furent amenées à la vie par des sorciers il y a de cela longtemps. La \r\ngargouille est une créature fourbe et traîtresse : rien ne distingue une gargouille « vivante » d’une \r\ngargouille « inanimée » ce dont elles profitent avantageusement. Observer et repérer les ennemis, \r\ndécouvrir leurs points faibles avant d’attaquer sont autant de qualités qu’elles ont développé au fil du \r\ntemps. Une fois blessées, les gargouilles reviennent souvent dans un état de pierre très dure afin de \r\nprendre le temps de se régénérer et seuls les aventuriers les plus habiles et les plus équipés peuvent alors \r\nespérer les achever. \r\n\r\n'),(15,'griffon','Griffon','bete',1000,600,600,28,22,10,13,13,400,500,0,0,0,0,'','#10°posture@_19;#09=10@_55;#14<5@_52;_6;!',14,12500,788,'hg1-250;hg2-5000;o16-12;o26-200;o22-80;l117-230;l118-230;l135-230;l136-230;l137-230;l138-200;l139-200;l140-200;l99-230;l98-170;l89-170',1110,'','1','y','Créature massive et dangereuse, la naissance des griffons est semble-t-il naturelle. D’autres \r\nracontent que des mages des temps Anciens auraient fait des expériences sur les races animales et que le \r\ngriffon en serait le résultat.  Quoiqu’il en soit, vous le reconnaîtrez aisément dans les plaines : un corps de \r\nlion, une tête d’aigle et des ailes immenses font de lui un animal hors du commun ! Vous pourrez vous \r\némerveiller devant lui un moment et exalter devant son aura de puissance et de beauté… Prenez garde \r\ntout de même, à ne pas le blesser car une fois le sang versé, il perdra tout son sang froid et se laissera \r\ndominer par sa soif de sang jusqu\'à sa mort, ou, plus sûrement, la votre ! \r\n\r\n'),(16,'worg','Worg','bete',400,100,20,17,10,10,12,12,100,100,50,25,25,25,'','_8;!',4,1300,68,'hg1-385;o20-45;o4-140',1410,'','4','y','Prompt à l’attaque et plus intelligent que ses congénères mammifères, peu de choses permettent de \r\ndistinguer  ce félin d’un bloc de glace jusqu’au moment fatal. Une fois dévoilée, cette créature magique \r\nressemble à s’y méprendre à un guépard de glace, mais il est alors souvent trop tard pour espérer éviter \r\nl’affrontement.  \r\n\r\n'),(17,'scarabee_geant','Scarabée Géant','bete',80,100,100,10,15,10,10,10,50,75,50,50,50,50,'','',3,550,26,'hg1-833;o24-120',1440,'','3','y','D’étranges mutations peuvent arriver dans le désert. Le scarabée géant en est la preuve. Pour \r\nl’appâter, rien de plus simple : cherchez un groupe de ses comparses classiques et écraser les délicatement \r\ndu bout du pied, le bruit de craquement devrait alors l’attirer. Prenez néanmoins garde, un scarabée géant \r\nfurieux peut s’avérer assez dangereux ! \r\n\r\n'),(18,'elementaire_feu','Elémentaire de feu','magique',760,350,500,19,19,16,16,16,200,200,250,125,125,125,'','#14<4@~10;#14<3@~149;#>@~6;#>@~13',10,6000,443,'hg1-133;o22-100;o24-100;l15-130;l14-130;l16-130;l31-130;l33-130;l32-130;l43-130;l44-130;l45-130;l46-130;l47-130;l56-130;l57-70;l59-130;l58-130',1230,'','3','y','Créature magique se nourrissant de toute source de chaleur, l’élémentaire de feu peut être croisé \r\ndans le désert. D’apparence tantôt humanoïde, tantôt difforme, son corps est totalement constitué de \r\nflammes jaunâtres hormis deux zones de feu d’un bleu profond qui rendent son regard terrifiant. Ne vous \r\nfiez pas a sa taille si vous en croiser un : alors qu’une seconde auparavant, il était de la taille d’une \r\nflammerole, il peut tout à coup se transformer en une vague de flamme qui vous consumera ! \r\n\r\n'),(19,'dryad','Dryade','magique',200,90,100,10,17,10,14,14,80,130,50,50,50,50,'','#09=1@~78;!',4,900,41,'hg1-357;o10-40;o4-75',1410,'','2','y','Nymphes des arbres, les dryades aiment chanter la nuit pour attirer les voyageurs dans leurs \r\ncercles et danser avec eux. Nombreux sont ceux qui toute la nuit durant profitent de cette atmosphère \r\nirrésistible de fête jusqu\'à l’épuisement. A l’aube, les dryades se transforment alors en redoutables \r\ncréatures et profitent de la fatigue de leurs victimes pour les attaquer violement. \r\n\r\n'),(20,'faucon','Faucon','bete',80,15,5,10,16,10,10,10,25,40,0,0,0,0,'','',2,250,14,'o16-25',1470,'','1','y','Prédateur aérien très rapide lorsqu’il chasse, le faucon est néanmoins un animal feignant aimant se \r\nlaisser porter par les courants d’air chaud. Cette phase de digestion ou il est presque statique est le \r\nmoment idéal pour tenter de l’attaquer à distance à l’aide d’un arc ou d’un lance pierre. \r\n\r\n'),(21,'chameau','Chameau','bete',110,15,10,13,13,10,12,12,25,30,0,0,0,0,'','',2,230,16,'o3-20',1470,'','3','y','Quadrupède du désert, le chameau peut être apprivoisé pour servir de monture et traverser les \r\nvastes étendues désertiques. De nombreuses personnes préfèrent néanmoins le chasser soit pour sa viande, \r\nsoit pour la graisse de ses bosses qui permet de fabriquer des bougies pour les veillées nocturnes. Prenez \r\nnéanmoins garde : les vieux males peuvent se montrer très agressifs lorsque l’on manque d’expérience \r\npour les approcher. \r\n\r\n'),(22,'fourmi_geante_ouvrier','Fourmi géante ouvrière','bete',70,100,75,15,15,10,10,10,80,70,0,0,0,0,'','',3,650,30,'hg1-1000;o4-100',1440,'','2','y','Les fourmis ?! Inoffensives ?! Prenez garde ! Lorsque celles-ci atteignent des dimensions \r\nrespectables, leurs mandibules peuvent être comparées aux meilleurs hachoirs sortis des forges naines… \r\nLes fourmis ouvrière sont particulièrement massives et dangereuses, mais leur lenteur permet en général à \r\nl’aventurier prudent d’éviter les mauvais coups. \r\n'),(23,'fourmi_geante_soldat','Fourmi géante soldat','bete',600,300,150,18,16,10,10,10,250,200,0,0,0,0,'','#10°posture@_21;#14<5@_51;#14<5@_42',6,2000,113,'hg1-213',1350,'','2','y','Plus grandes et plus dangereuses que les fourmis géantes ouvrières, cette variété de fourmis à pour \r\ncharge de défendre la fourmilière. En général très présentes sur le front lorsque deux colonies de fourmis \r\ns’affrontent, des individus isolés peuvent être rencontrés en forêt. Un seul mot d’ordre alors : tuer ou être \r\ntuer, vous vous êtes désormais trop approché de leur nid pour pouvoir éviter l’altercation. \r\n\r\n'),(24,'cockatrice','Cockatrice','bete',760,260,260,19,17,16,12,12,200,200,170,30,130,50,'','#14<4µ#11°paralysie@~19;#14<3µ#11°poison@~20;#13+poison@~136;#14<5@~47',8,3500,480,'hg1-159;o22-60;l12-70;l13-100;l23-130;l24-70;l25-130;l26-130;l28-70;l27-130;l52-130;l53-130;l54-130;l55-130;l62-70',1290,'','1','y','Créature disgracieuse, ressemblant à un grand volatile avec une queue de lézard, la cockatrice est \r\nune créature dangereuse et agressive que l’on peut rencontrer dans les plaines. Les nervures de leurs ailes, \r\ninutiles pour voler, sont dotées de griffes acérées et rendent la cokatrice difficile à approcher. Pour \r\nl’aventurier courageux qui désirerait la chasser, prenez également garde à sa queue, qui peut lui servir \r\npour accrocher vos jambes et vous déstabiliser. \r\n\r\n'),(25,'tigre','Tigre','bete',800,350,350,22,19,10,12,12,300,400,0,0,0,0,'dague','#10°posture@_19;#14<5@_13;#14<5@_42;!',10,5000,750,'hg1-125;o12-75;o5-100;l15-130;l14-130;l16-130;l31-130;l33-130;l32-130;l43-70;l44-70;l45-70;l46-70;l47-70;l56-70;l57-130;l58-130;l59-130',1230,'','2','y','Prédateur naturel de tous les mammifères, le tigre se camoufle dans les bois de manière à \r\nsurprendre ses proies au dernier moment. Déjà dangereux de jour, sa très bonne vision nocturne le rend \r\nencore plus mortel de nuit. Son attaque favorite consiste à attaquer ses proies au niveau de la nuque pour \r\nles égorger, avant de se repaître de leurs chairs encore tièdes… \r\n\r\n'),(26,'tigre_blanc','Tigre blanc','bete',820,300,250,20,18,10,11,11,250,300,0,0,0,0,'','_12;!;#09=3@_30;#09=4@_24;#09=6@_54',9,5000,608,'hg1-143;o12-40;o25-150;l30-70;l29-130;l41-130;l42-130',1260,'','4','y','Plus petits que leurs cousins des plaines, les tigres blancs sont néanmoins plus agiles et tout aussi \r\ndangereux. Leur pelage blanc immaculé, rayé de noir, permet au voyageur de les discerner dans les \r\ngrandes étendues de la banquise. Néanmoins, son odorat très développé lui permet de suivre les traces de \r\nses proies des heures après leur passage. Pensez à regarder régulièrement dans votre dos, aucun bruit ne \r\nvous préviendra de sa filature avant le moment fatidique ! \r\n\r\n'),(27,'momie','Momie','magique',960,600,800,27,18,15,18,18,290,440,300,50,150,50,'','#11°paralysieµ#09>7@~32;#14<5@~91;#14<5@_48',13,11000,1268,'hg1-200;hg2-6667;o8-150;l37-100;l63-70;l110-200;l111-200;l112-200;l113-200;l114-200;l115-200;l116-200;l129-200;l130-200;l131-200;l132-200;l133-200;l134-200;l91-200;l92-200;l93-200;l94-200;l95-200;l96-200;l97-200;l64-200;l65-200;l66-200;l67-200;l68-200;l69-200;l70-200;l71-200',1140,'','3','y','Dans des temps anciens, les habitants du désert honoraient leurs morts issus de castes riches et \r\nimportantes en les embaumant. Le corps, une fois baigné dans une solution permettant de préserver son \r\ncorps, était vidé de ses organes internes et recouvert de bandelettes. Enfermes dans des tombeaux de \r\npierre depuis des siècles, certaines de ses créatures auraient retrouvé leurs âmes, par des sortilèges anciens \r\net oubliés, et réussi à détruire leur sarcophage. Elles parcourraient actuellement les étendues désertiques \r\ndu monde de Starshine en quête de chair fraîche. Vous les reconnaîtrez aisément : se sont les seuls \r\ncréatures du désert se promenant enrubannées dans des bandelettes de lin. \r\n\r\n'),(28,'djinn','Djinn','magique',1400,800,1000,23,21,21,21,21,500,500,400,50,50,200,'','#10°posture@~101;#14<3@~171;#14<3@~43;#>@~40',18,18500,2431,'hg2-1666',990,'','3','y','Génies de l’air, les Djiins maitrisent ce plan élémentaire tant par leur puissance que par leur \r\nintelligence. Imperceptibles à nos sens en règle générale, on les perçoit parfois grâce aux sifflements \r\nqu’ils émettent. Plutôt pacifiques et solitaires de nature, on les trouve dans le désert d’Ancamar ou ils se \r\npromènent souvent de nuit dans des lieux déserts. Ils peuvent néanmoins facilement s’emporter face à une \r\nagression quelconque et ils se déplacent alors à une extrême rapidité en réalisant des figures aériennes \r\nimpressionnantes. Inutile d’essayer de s’échapper alors, votre fuite serait dans tous les cas trop lente. \r\n\r\n'),(29,'ogre','Ogre','humanoide',840,400,200,20,15,10,11,11,300,250,1,1,1,1,'','#10°berzeker@_10;_6;#00<30@_54;#09=4@~1;#09=5@~111;#09=6@_29',9,5500,608,'hg1-143;o8-180;l29-130;l30-130;l41-130;l42-70',1260,'','6','y','Brutes sanguinaires beaucoup plus grandes qu\'un humanoïde, les ogres sont de créatures stupides \r\nmais dangereuses qui ne sont intéressées que par trois choses : le sommeil, la bouffe et la bagarre. Dans \r\nleur culture, la partie de leur corps la plus importante est leur ventre, qu’ils protègent en général par une \r\ngrande plaque de métal. Les ogres adorent les compétitions : concours de rots, concours de bouffe, \r\ncombats à mains nues ou à tronc d’arbre… Très bruyants, ils sont en général faciles à éviter dans les \r\nmontagnes. \r\n\r\n'),(30,'lezard','Lézard','bete',60,0,1,8,12,10,10,10,10,10,0,0,0,0,'','',1,100,8,'o3-20',1500,'','7;11','y','Ce nourrissant quasi exclusivement de soleil, les lézards ne sont guère difficiles à trouver. Les \r\ndescriptions varient suivant ceux qui les ont vus : verts ou marrons, avec ou sans queue, etc… Néanmoins \r\ntous s’accordent a dire qu’ils dépassent rarement les 30 cm… \r\n'),(31,'petite_salamandre','Petite salamandre','bete',64,0,1,11,12,10,10,10,11,11,0,0,0,0,'','',1,100,8,'o3-20',1500,'','6','y','Souvent confondues avec leurs homologues des marais, les lézards, les salamandres se distinguent \r\npar leurs couleurs chatoyantes. Créatures semi-aquatiques présentes en montagnes aux abords des lacs, \r\nelles sortent plus facilement de leurs abris le lendemain de fortes pluies \r\n'),(32,'renard_gris','Renard gris','bete',90,15,5,13,13,10,10,10,35,30,0,0,0,0,'','',2,300,15,'o3-20',1470,'','4','y','Homologue de son cousin des plaines, le renard gris se distingue par la couleur de son pelage et \r\npeut être trouvé dans les étendues arides de la banquise. Son pelage très épais sert à la confection de \r\nbottes et manteaux pour se protéger lors des longues soirées d’hiver. \r\n\r\n'),(33,'nuee_de_moustiques','Nuée de moustiques','bete',60,75,95,10,17,10,10,10,60,100,0,0,0,0,'','',3,600,30,'hg1-900',1440,'','7;11','y','Inoffensifs pris individuellement, les moustiques peuvent tout de même s’avérer dangereux \r\nlorsqu’ils attaquent en nuée. En effet, si une unique piqûre peut s’avérer bénigne,  des centaines peuvent \r\nvous vider une créature massive de tout son sang et il n’est pas rare de retrouver un aventurier imprudent \r\navec au sens propre, sa seule peau sur les os… \r\n\r\n'),(34,'puma','Puma','bete',300,100,90,15,15,10,11,11,120,120,0,0,0,0,'','_8;!',4,1000,45,'hg1-385;o20-45;o4-140',1410,'','6','y','Felin massif et dangereux, le puma peut être croisé dans les montagnes ou à ses abords. \r\nReconnaisable à sa tête ronde et ses oreilles courtes, il fait preuve d’une grande agilité et peut monter aux \r\narbres pour surprendre ses futurs repas ou fuir ses prédateurs. Randonneurs ou chasseurs, n’oubliez donc \r\npas de lever les yeux si vous escomptez survivre en montagne ! \r\n\r\n'),(35,'goblin','Goblin','humanoide',500,300,150,16,13,10,10,10,200,100,0,0,0,0,'','#14<5@_45;#14<3@_41;_6;!',5,1500,75,'hg1-263;o3-15',1380,'','6','y','Créatures humanoïdes à la peau rouge, les gobelins sont des créatures brutales. Habitant dans les \r\ngaleries souterraines des montagnes, leur vision nocturne fait d’eux des prédateurs redoutables pour les \r\nchasseurs. En général peu discrets, ils sont tout de même assez faciles à éviter pour les voyageurs \r\nprudents et peu avides d’observer leur célèbre dentition de plus près.  \r\n\r\n'),(36,'zombie','Zombie','magique',600,200,150,20,10,10,10,10,180,100,0,0,0,0,'','#14<5@_5;#14<5@_44',5,1500,75,'hg1-263;o3-15',1380,'','7;11','y','Morts-vivants assoiffés de sang, les zombies sont issus de résurrections ratées. Dans ces corps \r\nnécrosés, leurs âmes damnées vouent une haine sans mesure a toutes les créatures vivantes. Ils sont en \r\ngénéral repérables à l’odeur de leurs chairs en décomposition, mais il est alors souvent trop tard pour \r\nprendre la fuite et le combat s’avère inévitable. \r\n\r\n'),(38,'crocodile','crocodile','bete',580,400,170,19,14,10,10,10,260,180,0,0,0,0,'','#10°posture@_22;#14<5@_6;#14<5@_48;!',6,2100,113,'hg1-213;o20-35',1350,'','7;11','y','Créature bien connue, les crocodiles sont des créatures aimant se prélasser dans les rivières ou \r\ndans les mers. Leur apparente nonchalance semble les rendre peu dangereux pour les créatures terrestres, \r\nmais en réalité, ils s’avèrent très rapide, dans l’eau comme sur terre, lorsqu’ils chassent à l’affût. Rare \r\nsont les témoins qui ont assisté à leur charge sans y laisser un de leurs membres.'),(39,'araignee_de_glace','Araignée de Glace','bete',600,300,150,16,16,10,10,10,250,200,0,0,0,0,'dague','#10°posture@_20;#>µ#14<5@_12;#10°dissimulation@_27;#12+dissimulation@_30',6,2000,113,'hg1-213;o21-35',1350,'','4','y','Qui craindrait une araignée ?! En réalité, les araignées des glaces grandissent sans arrêt jusqu\'à \r\nleur mort : on a déjà croisé des individus pouvant atteindre 9 pieds de haut. Leur corps, constitué d’une \r\nglace dense, est très résistant et n’est affecté que par des armes contendantes et par le feu. D’autre part, la \r\npureté de leur structure les rend très difficile à voir au loin et rend très dangereuse la chasse sur leur \r\ndomaine. \r\n\r\n'),(40,'roc','Roc','bete',800,200,200,20,15,10,11,11,250,200,0,0,0,0,'','#10°berzeker@_10;#00<60@_54;#09=3@_30;#09=4@_8',8,3400,195,'hg1-159;o22-60;l12-130;l13-130;l23-130;l24-130;l25-130;l26-130;l28-130;l27-130;l52-130;l53-130;l54-70;l55-70;l62-130',1290,'','6','y','Créature des montagnes fantastique, le roc est un oiseau dont l’envergure peut atteindre plus de 50 \r\npieds. Il n’est pas rare de voir l’un d’entre eux s’attaquer à des gobelins ou des pumas pour les laisser \r\ntomber afin de se nourrir de ses entrailles. Ces œufs, de la taille d’un homme sont farouchement surveillés \r\npar la mère. Ne les confondez donc pas avec des menhirs et évitez de vous en approcher ! \r\n\r\n'),(41,'hydre','Hydre à 3 têtes','bete',800,200,200,24,10,10,11,11,250,160,0,0,0,0,'','#09>8@_54;#10°berzeker@_9;#14<5@_48;!',8,3200,199,'hg1-159;o22-60;l12-130;l13-130;l23-130;l24-130;l25-130;l27-130;l26-130;l28-130;l52-70;l53-70;l54-130;l55-130;l62-130',1290,'','7;11','y','Créature des marais au corps difforme, l’hydre vit en général près des étendues d’eau.  Son corps \r\nmassif la rend très lente, mais ses 3 têtes reptiliennes sont d’une vivacité fatale pour qui n’y prendrait \r\ngarde. Seule une de ses têtes gouverne son corps, et trancher les autres rend la bête encore plus \r\ndangereuse étant donné que celles-ci se régénèrent en double. Certains racontent avoir vu (de loin) des \r\nhydres possédant plus d’une dizaine de tête. \r\n\r\n'),(42,'succube_mineur','Succube Mineure','magique',560,350,450,18,20,20,18,18,200,200,350,125,220,125,'','#00<10@~58;#11°appel_tenebre@~66;#14<5@~84',10,7000,750,'hg1-125;o10-20;o5-100;o10-15;l14-70;l15-130;l16-130;l31-70;l33-130;l32-130;l43-130;l44-130;l45-130;l46-130;l47-130;l56-130;l57-130;l58-130;l59-130',1230,'','7;11','y','Démon d’apparence féminine/masculine, la succube a toujours un air charmant et espiègle pour \r\nattirer les hommes/femmes dans ses filets. Ne vous fiez pas aux apparences car aussitôt à portée de ses \r\nbras, celle-ci vous embrassera et vous entraînera au septième ciel dans une étreinte mortelle qui sera \r\nsûrement la dernière que vous connaîtrez. \r\n\r\n'),(43,'cyclope','Cyclope','humanoide',900,300,500,25,20,10,14,14,300,300,0,0,0,0,'','#10°berzeker@_9;#10°posture@_25;#14<5@_6;!',11,8000,908,'hg1-150;o19-150;l17-130;l34-130;l50-130;l61-70;l60-130',1200,'','6','y','Plus forts et plus résistants que les ogres et les géants, les cyclopes sont facilement reconnaissables \r\nà leur œil unique situé au milieu de leur front. Rejeté de la société depuis des temps immémoriaux, les \r\ncyclopes se sont isolés dans les montagnes du monde de Starshine et gardent une rancoeur amère envers \r\ncette civilisation qui les a rejeté Dès lors, ils n’hésitent pas à chasser les inconscients qui voudraient les \r\nrencontrer à l’aide de rochers de plusieurs centaines de livres. \r\n\r\n'),(44,'ogre_a_deux_tetes','Ogre à deux têtes','humanoide',1200,600,600,28,20,10,13,13,500,500,0,0,0,0,'','#09=10@_55;#10°berzeker@_10;#14<5@_49;#>@_6;!',15,14000,1688,'hg2-3333;o26-100',1080,'','6','y','Originellement, les ogres à deux têtes ne vivaient qu’entre les montagnes entre Akheva et \r\nMalekhive ou la proximité avec les désert d’Ancamar aurait affecté leurs gènes et fait pousser une \r\nseconde tête. Ayant migré par la suite dans les montagnes du monde de Starshine, ils causèrent grand mal \r\naux nains de Khazad Dorr il y a quelques siècles. \r\nLeurs deux têtes sont indépendantes, ce qui ne les rend pas beaucoup plus intelligent que leurs \r\ncongénères classiques, et il n’est pas rare de voir un tel ogre s’automutiler à la suite d’une dispute entre \r\nses deux têtes. Plus grand et plus forts que les ogres normaux, il constituent une cible de choix pour \r\nl’aventurier en quête d’honneur, mais prenez garde, ces ogres sont très difficiles à surprendre et il n’est \r\npas rare de voir les deux têtes veiller successivement de nuit pour se protéger des intrus. \r\n'),(45,'hydre_5','Hydre à 5 têtes','bete',960,700,700,30,20,10,16,16,350,400,0,0,0,0,'','#10°berzeker@_10;#11°posture@_24;#14<5@_48;#14<5@_6',12,11000,1080,'hg1-167;hg2-10000;o22-60;l18-130;l19-130;l36-130;l35-100;l49-70;l48-130',1170,'','7;11','y','Créature des marais au corps difforme, l’hydre vit en général près des étendues d’eau.  Son corps \r\nmassif la rend très lente. A l’origine dotée de 3 têtes reptiliennes d’une vivacité fatale, les hydres à 5 têtes \r\nsont celles dont deux têtes on un jour été coupées : seule une de ses têtes gouverne son corps, et les autres \r\nse régénèrent en double une fois tranchées. Certains racontent avoir vu (de loin) des hydres possédant \r\nplus d’une dizaine de tête. \r\n\r\n'),(46,'yeti','Yeti','humanoide',900,600,820,26,20,10,10,10,300,420,0,0,0,0,'','#10°posture@_24;#14<5@_48;#09=10@_54',12,9900,1080,'hg1-167;hg2-10000;o12-30;l19-70;l18-130;l36-130;l35-100;l48-130;l49-130',1170,'','4','y','Primate velu vaguement humanoïde, le Yeti mesure entre 10 et 15 pieds de haut. Doté d’une \r\ntoison très épaisse qui lui permet de résister à de grands froids,  il ne sort de sa tanière que par grande \r\ntempête afin d’éviter de croiser d’autres humanoïdes. De larges empreintes témoignent de son passage et \r\npeuvent être suivies jusqu\'à sa tanière pour le chasser. Le sport favori du Yeti étant le lancé de pingouins, \r\nune autre méthode de chasse consiste à observer le ciel en attendant d’en voir un planer et relever la \r\ndirection d’où il vient… \r\n\r\n'),(47,'basilic','Basilic','bete',1260,600,800,28,22,10,14,14,500,600,350,175,175,175,'','#14<3µ#11°paralysie@~32;#13+paralysie@~144;#14<5@~125;#>@~84',16,16000,1920,'hg2-2500;o22-50',1050,'','2','y','Reptile fabuleux, le basilic est une légende en soit tant survivre à sa rencontre est difficile. De la \r\ntaille d’un cheval, et aussi véloce qu’un cobra, le basilic est aveuglé par la lumière du jour et percoit ses \r\ncibles au bruit et à la vibration de l’air. Son regard a le pouvoir de changer ses victimes en pierre, son \r\nhaleine fétide est à même de rendre malade le plus résistant des aventuriers et sa peau sécrète en \r\npermanence un poison paralysant. On dit que les seuls moyens de le battre sont de le surprendre, ou de le \r\ncombattre les yeux fermés à distance, chose difficile si l’on en croit les histoires sur sa vitesse. Un conseil \r\ndonc, n’entrez jamais dans une caverne si celle-ci dégage une odeur putride, et si d’aventure vous croiser \r\nune sorte de lézard géant restez immobile et prier qu’il ne perçoive pas les battements frénétiques de votre \r\ncoeur ! \r\n\r\n'),(48,'manticore','Manticore','magique',1600,1000,1000,24,24,20,22,22,500,550,500,250,250,250,'','#10°posture@_20;#14<3µ#11°paralysie@~32;#13+paralysie@~146;#09<10@_6;!',20,23500,3001,'hg2-1250;o22-30',930,'','6','y','Apparenté par erreur au griffon, la manticore possède en effet un corps de dimensions \r\néquivalentes mais est d’une intelligence bien supérieure qui n’a d’égal que sa cruauté. Son corps \r\nmonstrueux, hérité du lion, se termine d’un coté par une tête vaguement humaine,  et de l’autre par une \r\nqueux recouverte de pointes d’un pied de long. Des griffes ornent son menton et l’extrémité de ses ailes et \r\nsont à même de transpercer la plus épaisse des armures. Ce corps massif fait d’elle un adversaire de taille \r\nau corps a corps, et on pourrait espérer l’attaquer à distance : ne vous y trompez pas, capable de lancer \r\ndes dards venimeux pour immobiliser son adversaire, elle est tout aussi dangereuse à distance ! \r\n\r\n'),(49,'renard_du_desert','Renard du désert','bête',260,100,100,12,16,10,11,11,100,140,0,0,0,0,'','_8;!',4,995,45,'hg1-370;o20-45;o4-140',1410,'','3','y','Homologue de son cousin des plaines, le renard du désert se distingue par son pelage couleur sable \r\net par les dimensions importantes de ses oreilles. Encore plus vif et plus difficile à approcher que ses \r\ncousins, il peut se révèler très dangereux pour les voyageurs éreintés du désert. \r\n\r\n'),(50,'elementaire_terre','Elémentaire de Terre','magique',900,600,400,42,10,10,12,12,250,200,0,0,0,0,'','#10°posture@_25;#14<5@_48',10,7000,750,'hg1-133;o22-80;o25-200;l14-130;l15-130;l16-130;l32-70;l33-130;l31-130;l43-130;l44-130;l45-130;l46-130;l47-130;l56-130;l57-130;l58-130;l59-130',1230,'','6','y','Créature magique des montagnes, l’élémentaire de terre est un adversaire de taille doté d’une force \r\nsurhumaine. Prenant souvent une forme humanoïde, celui-ci est très résistant et ne peut-être détruit que \r\nprogressivement : chaque morceau de terre que vous lui ôteriez se régénérera rapidement si celui-ci est \r\ntoujours fermement installé sur le sol. Capable de faire trembler la terre par sa seule volonté, il répondra \r\nviolement à une quelconque intrusion sur son territoire. \r\n\r\n'),(51,'waja','Waja','humanoide',360,150,150,10,12,10,12,12,160,150,0,0,0,0,'dague','#10+posture@_20;#14<5@_41;#14<5@_11',5,1200,71,'hg1-230',1380,'','3','y','Créature bipède du désert, les wajas sont une espèce peu dangereuse pour quiconque se promène \r\ndans le désert. Fins commercants et durs négociateurs, ils se transforment néanmoins en redoutables \r\ntueurs lorsqu’ils se sentent menacés… Réfléchissez y a deux fois avant de vous attaquer à eux car leur \r\nfrêle stature peut s’avérer très dangereuse une fois acculés. \r\n\r\n'),(52,'golem_des_sables','Golem Des Sables','magique',840,250,250,22,16,10,12,12,280,260,0,0,0,0,'','#10°berzeker@_10;#11°posture@_21;#14<5@_48',9,5500,608,'hg1-143;l30-130;l29-70;l41-130;l42-130',1260,'','3','y','Créature née de l’esprit d’un savant fou, le golem est amené à la vie par une inscription apposée \r\nsur son front. La légende veux que le premier golem ait tué son créateur et reproduit sur le sable le \r\nsymbole présent sur son front. Depuis, une population de golems habite le désert et il semble impossible \r\nde les éliminer définitivement. Si en l’absence de vent, vous apercevez une butte de sable bouger, fuyez, \r\nil est peu probable qu’un petit scorpion enfouit dans le sable soit a l’origine d’un tel mouvement. \r\n\r\n'),(53,'ours_polaire','Ours polaire','bete',700,200,180,18,14,10,10,10,220,200,0,0,0,0,'','#12+poisonµ#10°posture@_25;#14<5@_6;#14<5@_48;!',7,2200,368,'hg1-179;o12-40;l10-730;l11-730;l20-130;l21-130;l22-130;l38-130;l39-70;l40-70;l51-70',1320,'','4','y','Apparenté à son cousin des plaines par sa forme, l’ours polaire se distingue bien sur par sa \r\ncouleur, mais plus particulièrement par sa taille massive. D’ordinaire peu agressif et très joueur, il faut \r\ntout de même prendre garde à ne pas se faire repérer. Peu importe alors qu’il décide de vous prendre \r\ncomme compagnon de jeu ou qu’il vous considère comme une menace : le résultat est le même tant il ne \r\ncontrôle pas sa force et la neige de la banquise prend alors une couleur rouge sang, le votre… '),(54,'treant','Treant','magique',900,800,300,39,13,10,15,15,280,180,250,150,0,0,'','#10°recuperation@~21;#14<5@_48;!',10,7000,750,'hg1-133;o25-200;l16-70;l14-130;l15-130;l33-70;l31-130;l32-130;l43-130;l44-130;l45-130;l46-130;l47-130;l56-130;l57-130;l58-130;l59-130',1230,'','2','y','Grands arbres protecteurs des forêts, les treants ne sont pas à proprement parler des guerriers, mais \r\nils défendent farouchement les forêts des tentatives d’intrusion et surtout de saccage. Rien ne permet au \r\npremier abord de les distinguer d’un arbre classique et leur taille varie suivant leur variété. Souvent \r\nimmobiles et pacifiques, ils sont responsables de la disparition de nombreux bûcherons imprudents dans \r\nles forêts du monde de Starshine. \r\n\r\n'),(55,'vautour','Vautour géant','bete',600,350,125,14,18,10,14,14,260,180,0,0,0,0,'','#10°posture@_25;#14<5@_51;#14<5@_45;!',6,2000,270,'',1350,'','3','y','La mutation des créatures terrestres du désert a également altéré les charognards qui se \r\nrepaissaient de leurs chairs nécrosés. Pouvant atteindre des envergures de près de 10 pieds, occultant la \r\nlumière du soleil à leur passage, les vautours géants n’hésitent désormais plus à s’attaquer aux créatures \r\nvivantes, dont la chair est plus juteuse et moins rance. \r\n\r\n'),(56,'sworling','Sworling le téléporteur','npc',2,1,1500,1,1,1,10,10,1,2000,1,0,0,0,'','',6,1,1,'',0,'','rand','n',''),(57,'protecteur_defunt','Squelette de Myriandre','magique',600,150,250,13,13,12,15,15,100,100,0,0,0,0,'dague','#10°posture@_21;#10°dissimulationµ#14<5@_26;#12+dissimulation@_29;#14<5@_8;!',5,3000,150,'q27-49',0,'p86-71','10','n',''),(58,'exolasher','Exolashers Myriandre','magique',2000,300,150,15,13,10,10,10,200,15