-285;p21-285;p22-285;p17-286;p18-286','15','n',''),(120,'shaman_goblin','Shaman goblin','humanoide',1900,900,900,26,19,27,16,15,400,400,500,0,200,200,'','#10°posture@~101;#14<5µ#11°paralysie@~32;#11°appel_tenebreµ#14<3@~67;#14<5@~172;#>@~40;#>@~14',15,14400,2026,'a49-100;a42-100;a54-100;p85-100;p75-50;hg1-200;hg2-3000',0,'p24-283;p25-283;p26-283;p25-284;p17-277;p17-278;p18-278;p18-279;p13-279;p14-279;p13-280;p33-284;p34-284;p30-285;p31-285;p14-288;p14-287;p15-287;p19-286;p25-286;p25-287;p26-287;p27-289;p28-289;p32-294;p33-294;p34-294;p38-292;p38-294','15','n',''),(121,'archer_goblin','Archer goblin','humanoide',2600,800,800,28,24,10,12,13,500,500,0,0,0,0,'arc','#10°posture@_109;#14<3@_86;#14<5@_89;#14<5@_93;#>@_117',16,15000,2251,'a28-100;p89-100;p86-100;hg1-500;hg2-2000',0,'p33-277;p34-277;p35-277;p33-278;p34-278;p35-278;p32-279;p34-279;p15-278;p13-276;p14-277;p12-281;p13-281;p29-284;p35-284;p34-285;p25-285;p15-286;p16-286;p24-287;p25-287;p27-286;p27-288;p28-288;p32-293;p33-292;p34-292;p37-292;p37-294;p41-293;p42-293','15','n',''),(122,'berserker_goblin','Berserker goblin','humanoide',2800,1000,800,47,25,10,12,12,540,500,0,0,0,0,'','#10°posture@_111;#10°berzeker@_99;#14<6@_81;#14<6@_102',17,16000,2626,'a21-100;a35-100;p87-100;p72-100;hg1-200;hg2-1500',0,'p36-284;p33-285;p35-285;p36-285;p13-285;p13-286;p14-286;p13-287;p12-288;p13-288;p27-290;p28-290;p27-291;p28-291;p28-291;p31-293;p32-292;p34-293;p35-293;p36-293;p37-293;p38-293;p38-291;p39-291;p40-291;p39-293;p39-292;p39-294;p43-293;p43-292;p43-294;p44-292;p44-294','15','n',''),(123,'roi_goblin','Roi Goblin','humanoide',5800,1400,1000,50,23,27,15,14,540,540,400,0,0,200,'','#10°posture@~101;#10°benedictionµ#14<5@~151;#14<5@_81;#14<6µ#14<6@_79',18,30000,6002,'hg1-5;hg2-5;p125-5;p126-5;a67-5;a68-3',0,'','15','n',''),(75,'finrwirr','Finrwirr le serviteur','magique',8000,700,300,20,20,10,10,16,400,300,0,0,0,0,'','#09=20@_55;#10°berzeker@_98;#14<5@_52;#14<5@_49;#14<5@_78',7,13000,675,'p114-10;a65-10;p111-3;a62-33',0,'','15','n',''),(76,'scarabee_mutant','Scarabée Mutant','bete',900,1000,800,25,25,10,10,10,395,300,0,0,0,0,'','#10°posture@_21;#14<5@_49;#09=10@_54',11,8381,908,'hg1-120;o18-100;l17-130;l34-70;l50-130;l60-130;l61-130',1200,'','3','y','Il existe de nombreuses espèce de scarabées, mais peu de monde peu se venter d\'avoir un jour \r\ncroisé dans le désert un scarabée mutant. Nul ne sait d\'ou ils proviennent, comme pour les autres \r\nmutations du désert, nombreux sont ceux qui supposent que leur taille énorme est liée aux radiations. \r\nLeur tête est surmontée d\'une longue corne, de 2 à 3 pieds de long, dont ils se servent pour chasser ou \r\néliminer les éventuels gêneurs avant de se repaître de leurs corps. \r\n\r\n'),(77,'pillards','Pillards','humanoide',840,700,700,24,25,10,14,14,395,300,0,0,0,0,'','#10°posture@_20;#14<5@_43;#14<5@_46',11,8381,908,'hg1-120;o26-300;l17-130;l34-130;l50-70;l60-130;l61-130',1200,'','1','y','Autrefois civilisés comme vous et moi, les pillards sont un ramassis d’être miséreux, rebut de la \r\nsociété, que l’appât du gain facile a attiré et qui vivent désormais reclus de la civilisation. Souvent très \r\nhabiles au combat, ils n’hésitent pas à attaquer les caravanes de marchands et les groupes d’aventuriers \r\npour quelques richesses supplémentaires, qu’ils revendent par la suite dans les marchés noirs de toutes les \r\ncapitales du monde de Starshine. \r\n\r\n'),(78,'centaure','Centaure','magique',800,850,600,21,25,10,13,13,395,300,0,0,0,0,'','#10°posture@_22;#14<5@_46;#14<5@_43',11,8381,908,'hg1-133;o20-80;o3-20;o10-30;l17-70;l34-130;l50-130;l60-70;l61-130',1200,'','2','y','Créatures mi-hommes, mi-chevaux, les centaures vivent dans des coins reculés et discrets telles \r\nque les forêts. Ils se nourrissent de chair crue et aiment de façon immodérée le vin et les femmes. Violents \r\net brutaux envers les étrangers, les centaures sont un peuple de guerriers qui n\'utilise que très rarement la \r\nmagie et dont la bravoure au combat n\'a d\'égal que leur maîtrise de l\'arc. Vous êtes prévenus, l’approche \r\nde leur territoire se fera à vos risques et périls ! '),(79,'phacochere_rieur','Phacochère rieur','bete',980,1200,700,30,20,10,14,14,410,310,0,0,0,0,'','#10°posture@_25;#14<5@_52;#14<5@_46',12,8727,1080,'hg1-167;hg2-10000;o12-30;l18-30;l19-130;l35-100;l36-130;l48-70;l49-130',1170,'','2','y','Espèce de porc de dimensions respectables, le phacochère rieur se distingue de par son physique \r\n(une longue crinière, deux défenses au bout de son museau) mais aussi de par son cri qui ressemble à s’y \r\nméprendre à un moquement, ce qui bien sur a tendance à énerver bon nombre d’aventurier. L’erreur \r\ncommunément faite est alors de l’attaquer pour lui faire fermer définitivement son clapet. En effet, le \r\nphacochère rieur n’a plus rien de drôle une fois qu’il vous a bousculé, éventré et piétiné ! \r\n\r\n'),(80,'hobgoblin','Hobgoblin','humanoide',1000,1500,700,31,22,10,15,15,425,400,0,0,0,0,'','#10°berzeker@_10;#14<5@_6;#14<5@_49',13,9043,1268,'hg1-200;hg2-6000;l37-100;l63-130;l110-200;l111-200;l112-200;l113-200;l114-200;l115-200;l116-200;l129-200;l130-200;l131-200;l132-200;l133-200;l134-200;l91-230;l92-170;l93-170;l94-230;l95-230;l96-230;l97-230;l64-170;l65-170;l66-170;l67-230;l68-230;l69-230;l70-230;l71-170',1140,'','6','y','Plus robustes et plus grands que les gobelins, les hobgobelins pourraient être assimilés à des \r\ngobelins surdéveloppés de près de 7 pieds de haut. Utilisant avantageusement leurs plus grand force et \r\nleur plus grande taille, ils sont devenus de redoutables adversaires, plus compétents et mieux organisés. \r\nOn les rencontre en général dans les montagnes et leurs groupes font parfois des razzias sur les villages \r\nles plus proches de leurs camps. \r\n\r\n'),(81,'centaure_des_neiges','Centaure des neiges','magique',900,900,660,31,24,10,14,14,425,380,0,0,0,0,'','#11°posture@_22;#14<5@_46;#14<5@_43',13,9043,1268,'hg1-200;hg2-6667;o12-20;l37-100;l63-130;l110-200;l111-200;l112-200;l113-200;l114-200;l115-200;l116-200;l129-200;l130-200;l131-200;l132-200;l133-200;l134-200;l91-170;l92-230;l93-230;l94-170;l95-170;l96-170;l97-170;l64-230;l65-230;l66-230;l67-170;l68-170;l69-170;l70-170;l71-230',1140,'','4','y','Homologues de leurs cousins de forêt, les centaures des neiges seraient en fait issus de la même \r\nsouche. Raffermis par les conditions climatiques rudes qu’ils subissent depuis des décennies, ils seraient \r\nde fait, beaucoup plus dangereux que les centaures des bois… Chassés de certaines forêts lors de guerres \r\nsanglantes les ayant opposés aux différents peuples au moment de la déforestation, ils auraient choisit de \r\nmigrer vers la banquise pour y profiter de la solitude.  Il s’agit peut etre d’une légende, nul ne sait \r\nexactement… A vrai dire personne n’a jamais osé leur poser la question.   \r\n\r\n'),(82,'demon_cercle_5','Demon Cercle 5','magique',1040,800,800,28,23,21,16,16,440,350,500,1,350,1,'','#11°appel_tenebre@~67;#14<5@~121;#>@~85',14,9333,1470,'hg1-250;hg2-5000;o19-100;l118-170;l117-230;l135-230;l136-230;l137-170;l138-200;l139-200;l140-200;l98-230;l99-230;l89-230',1110,'','7;11','y','Ces démons sont très présents dans les terres maudites, ou les énergies démoniaques et \r\nnécromantiques sont propices à leur développement. Le fait qu’ils ne fassent partie que du cinquième \r\ncercle vous fait rire ? Méfiez vous, la valeurs des démons ne se juge pas à la même échelle que la valeur \r\nde votre peuple et espèrez ne jamais rencontrer de démons des cercles supérieurs. \r\n\r\n'),(83,'liches','Liches','magique',1000,800,800,28,21,27,17,17,440,330,520,1,360,360,'','#14<5@~133;#14<3@~127;#>@~94',14,9333,1470,'hg1-250;hg2-5000;o26-100;l117-170;l118-230;l135-230;l136-230;l137-170;l138-200;l139-200;l140-200;l98-230;l99-230;l89-230',1110,'','3','y','Vieux sorciers maintenant leurs corps en vie grâce à leurs pouvoirs magiques, les liches sont \r\nhautement intelligentes et fortes d’une expérience très ancienne. Bien que maintenir leur corps en vie \r\ndissipe une partie importante de leur énergie, leur puissance reste néanmoins phénoménale et en fait des \r\nadversaires très dangereux pour le commun des aventuriers. Chaque liche est équipée d’un phylactère \r\ncontenant sa force vitale. Tant que celui-ci existe, même réduite en cendre, la liche se régénèrera pour \r\nvenir vous hanter de nouveau. \r\n\r\n'),(84,'myrmarque_formien','Myrmarque Formien','bete',1100,1200,700,36,22,10,16,16,440,420,500,0,320,0,'','#10°posture@_21;#14<5@~121;#14<5@_52',14,9333,1470,'hg1-250;hg2-5000;o8-100;l117-230;l118-230;l135-170;l136-170;l137-230;l138-200;l139-200;l140-200;l99-170;l98-230;l89-230',1110,'','2','y','Elite de la fourmillière, le myrmarque ne reçoit d’ordres que de la reine elle-même. Alors que les \r\nautres fourmis sont divisées en caste et condamnées à fléchir à l’esprit du groupe, les myrmarques sont \r\ndes individus à part entière, uniques et dangereux. Contrairement à leurs congénères qui n’utilisent que \r\nleur corps pour attaquer, il n’est pas rare de voir un myrmarque armé de lances et de javelots. Prenez \r\ngarde par ailleurs, car celles-ci sont souvent enduites d’un puissant poison. \r\n\r\n'),(85,'onikage','Onikage','humanoide',1200,900,900,39,25,10,16,16,455,430,1,1,1,1,'dague',';#12+poisonµ#10°posture@_20;#10°dissimulationµ#14<3@_28;#12+dissimulation@_31;#14<5@_14',15,9600,1688,'hg2-3333;o19-90',1080,'','7;11','y','Anciens serviteurs du seigneur des enfers. Les Onikages sont patients, d’une loyauté indéfectible \r\net dévoués à leur maitre. D’une force surhumaines, ils n’ont besoin de nulle arme, si ce n’est leurs doigts \r\ngriffus, pour vous terrasser au corps à corps. Ils cherchent en permanence à déstabiliser l’équilibre \r\nprécaire entre les peuples du monde de Starshine pour amener le chaos et la destruction dans le monde \r\ndes vivants. Frillants de batailles et de carnages, ils cherchent l’affrontement en toute situation et ont un \r\nsens de l’honneur très développé. De forme humanoïde, vous les distinguerez par l’aura de noirceur qui \r\nles entoure et par les tatouages qui couvrent l’intégralité de leur corps.'),(86,'chasseur_de_peau','Chasseur de Peau','humanoide',1160,1000,850,38,23,10,14,14,455,420,1,1,1,1,'','#10°berzeker@_9;#14<5@_49;#14<5@_6',15,9600,1688,'hg2-3000',1080,'','4','y','Difficiles à différencier des barbares de BriseBois, les chasseurs de peaux sont de redoutables \r\nguerriers arpentant la banquise en quête de fourrures, laines et toisons. Nomades depuis toujours, l’aridité \r\nde la banquise les a peu a peu forgé et rendu plus durs que l’acier. On les croises parfois sur les places de \r\nmarché de BriseBois : guerriers sombres et prompts à répondre à la provocation, ils se distinguent dans la \r\nfoule par un collier enchâssé des oreilles de leurs ennemis vaincus et arborent souvent un couvre-chef fait \r\nde la peau d’un des animaux qu’ils ont battus. Si l’un d’eux arbore fièrement la tête d’une abomination, \r\nbaissez les yeux, un simple regard pourrait être considéré comme insolent. \r\n\r\n'),(87,'scorpion_geant','Scorpion Géant','bete',1200,1100,850,41,26,10,15,15,470,470,350,1,190,1,'dague','#11°posture@_20;#14<3µ#11°poison@~20;#14<5@_14;#>@_43',16,9846,1920,'hg2-2500;o21-10',1050,'','3','y','Bête monstrueuse, les scorpions géants sont incroyablement grands, de la taille d\'un chameau \r\nvoire même plus grand. Capable de se cacher ou de se déplacer sous le sable, ce scorpion est un ennemi \r\ntrès dangereux malgré sa faible intelligence. A moins d’être très vigilant, il est souvent trop tard pour \r\nesquiver lorsque son dard, de quelques pieds de long, sort du sol pour vous transperser.Si vous les \r\nrencontrez, préférez des attaques à distance ou immunisez vous au poison… Ou si il vous en laisse la \r\npossibilité, courrez ! \r\n\r\n'),(88,'hippopotame_sanguinaire','Hippopotame Sanguinaire','bete',1300,1300,900,44,24,10,15,15,465,465,1,1,1,1,'','#10°berzeker@_10;#14<5@_78;#14<5@_80;#09=10@_55',16,9846,1920,'hg2-2500;o3-3',1050,'','1','y','Rien ne distingue cet hippopotame de ces cousins herbivores. Un air patelin, une masse de \r\nimposante, rien ne le distingue même dans l’eau douce d’un simple rocher lorsqu’il est immobile. Le seul \r\nmoyen de le différencier consiste à s’approcher suffisamment pour lui faire ouvrir la gueule : là ou vous \r\nauriez du trouver des canines d’un petit pied de long, vous reconnaîtrez facilement ses rangées de dents, \r\naiguisées comme des lames de rasoir, plates et triangulaires. Seul inconvénient de la méthode, il est alors \r\nsouvent trop tard pour échapper à ce redoutable mangeur d’homme ! \r\n\r\n'),(89,'wyverne','Wyverne','bete',1320,1200,900,47,24,10,16,16,485,485,380,1,240,1,'','#14<2µ#09<3µ#10°berzeker@_98;#11°poisonµ#14<3@~175;#14<5@_80',17,10074,2168,'hg2-2000;o21-9',1020,'','1','y','Souvent apparentées aux dragons, la wyverne est un serpent volant de plusieurs centaines de \r\nlivres. Mesurant jusqu\'à 40 pieds de long, il est doté d’ailes semblables à celles d’une chauve souris et son \r\nenvergure peut atteindre 20 pieds. La wyverne n\'a que deux pattes arrière et son corps se termine par une \r\nlongue queue dont l\'extrémité peut être apparentée à un dard de scorpion géant. La wyverne tue \r\nnéanmoins rarement ses proies par le poison : une simple morsure de sa gueule acérée de dents suffit en \r\ngénéral à couper en deux des animaux de la taille d’un cheval.  \r\n\r\n'),(90,'banshee','Banshee','magique',1300,1150,1000,26,22,30,15,15,485,420,600,1,380,1,'','#11°appel_tenebre@~68;#14<5@~133;#>@~94',17,10074,2168,'hg2-2000;o4-10',1020,'','7;11','y','Hurleur fantastique, le cri du banshee est plus horrible que le pire que vous ne pourriez jamais \r\navoir entendu, ou même imaginé. Apparenté à un hurlement suraigu de loup, de la puissance d’une \r\ntempête et portant un désespoir de tout un peuple, son cri noye le plus courageux des aventuriers dans le \r\ndésespoir et sa tête semble exploser, son sternum se met à vibrer et ses os à craqueler… Frèle \r\nd’apparence, au visage marqué par la douleur, le banshee pris isolement n’est pas dangereux en soit, mais \r\nlorsqu’il crie le monde semble s’effondrer autour de vous et vous rendrait incapable de combattre même \r\nune simple belette… \r\n\r\n'),(91,'elfe_noir','Elfe Noir','humanoide',1440,1200,1000,47,23,10,15,15,520,530,1,1,1,1,'','#10°posture@_106;#14<5@_77;#14<5@_82',18,10286,2431,'hg2-1500;o10-5',990,'','2','y','A une époque reculée, lors de l’apogée de leur civilisation, une scission quant à la marche à suivre \r\nface aux autres races divisa les elfes : alors que certains préféraient attendre et cohabiter avec elles, \r\nd’autres étaient partisans de l’élimination de ces races inférieures. Ceux-ci furent contraints à l’exil et \r\nquittèrent Keleth pour se cacher dans les bois plus profonds. Maudits par leurs cousins, les elfes noirs \r\nvouent depuis une haine indicible à tous les autres êtres vivants et on vendu leur âmes au chaos pour \r\nacquérir une puissance inégalable et, un jour, arriver à leurs fins. \r\n\r\n'),(92,'chitineux','Chitineux','bete',1500,1600,1000,50,23,10,15,15,520,480,1,1,1,1,'','#10°posture@_107;#14<5@_82;#14<5@_49',18,10286,2431,'hg2-1666;o26-3',990,'','4','y','Insecte géant, le chitineux survit sans difficulté dans les glaces. Son exosquelette robuste de près \r\nd’un pied d’épaisseur le rend insensible aux agressions de la plupart des créatures des neiges, et des \r\néventuels chasseurs ou proies. Creusant dans la glace d’immenses galeries pour former son repaire, le \r\nchitineux n’hésite pas à creuser à proximité de la surface de manière à former des pièges pour les \r\ncréatures terrestres. Une fois tombé dans son nid, il est dur de sortir de ce méandre et la rencontre avec cet \r\nêtre surnaturel dans son milieu naturel est  en général fatale. \r\n\r\n'),(93,'licorne','Licorne','magique',1640,1400,1100,56,24,10,18,18,515,515,400,200,1,1,'','#10°benediction@~87;#10°recuperation@~23;#14<5@_46',19,10483,2708,'hg2-1400;o10-5',960,'','1','y','Etres féeriques ressemblant à s’y méprendre à des chevaux, les licornes portent au milieu de leur \r\nfront une longue corne droite torsadée. Elle est l’image même de la nature dans ce qu\'elle a de plus pur, \r\nde plus beau mais aussi de plus juste. Sa crinière longue, d’un blanc aussi immaculé que sa robe, entoure \r\nun corps robuste témoin de sa puissance. Ces créatures fondamentalement bonnes sont à même de \r\ndécouvrir d’un seul regard, d’un bleu profond, vos vices et votre noirceur… Dès lors, elle tentera de vous \r\nattaquer pour épurer le monde de votre infâme présence. Innocent dites vous ? Nul ne l’est vraiment ! '),(94,'mouflon_demoniaque','Mouflon démoniaque','bete',1660,1350,1100,53,24,10,16,16,525,515,1,1,1,1,'','#10°posture@_111;#14<5@_49;#14<5@_77',19,10483,2708,'hg2-1400;o12-10;o20-5',960,'','6','y','Ce démon ne doit son nom qu’a la forme de son corps et de ses cornes, qui lui donnent \r\nl’apparence d’un énorme mouflon de la taille d’un griffon. Ne possédant pas de peau à proprement parler, \r\nde son corps à vif exalte une odeur de sang putride et de chair carbonisée Venu tout droit des enfer, il \r\narpente les montagnes en quête de sang et carnage et n’attaque les créatures vivantes que pour le plaisir \r\nde tuer et de faire souffrir. \r\n\r\n'),(95,'serpent_a_plumes','Serpent à Plumes','bete',1700,1400,1200,55,28,10,16,16,530,555,400,1,1,250,'','#14<5@_6;#14<5@_52',20,10667,3001,'hg2-1250;o16-10;o19-30',930,'','3','y','Wyverne miniature, le serpent à plume n’en est pas moins plus dangereux. Tandis que la wyverne, \r\nmassive, laisse une chance à son opposant de parer les coups et de contre-attaquer, le serpent à plume se \r\ndistingue par sa petite taille, de l’ordre du mètre, et sa vivacité. Présent dans le désert et aimant se \r\nprélasser sur les roches, le violant poison que secrète ses glandes peut terrasser en quelques dizaines de \r\nsecondes des créatures géantes. Attaquant de préférence les humanoïdes au cou, sa morsure empoisonne \r\nle cerveau en deux voire trois seconde.  \r\n\r\n'),(96,'succube','Succube','bete',1700,1380,1280,26,24,31,20,20,530,450,600,1,380,1,'','#00<20@~60;#14<5@~127;#14<5@~94',20,10667,3001,'hg2-1250;o10-5',930,'','7;11','y','Encore plus dangereuse que la succube mineure, ce démon est capable de lire dans votre esprit \r\ncomme dans un livre ouvert. Elle y trouvera vos désirs et phantasmes les plus secrets et fera tout des lors \r\npour vous attirer dans ses bras, prenant une apparence irrésistible pour vous séduire et vous parlant \r\ncomme vous l’avez toujours rêvé. Seuls les personnes ayant une volonté à toute épreuve peuvent se \r\ntarguer de l’affronter, mais dans ce cas, la succube n’hésitera pas prendre l’apparence de vos peurs et à \r\nfaire ressortir vos terreurs les plus profondes pour vous déstabiliser. \r\n\r\n'),(97,'abomination_des_tempetes','Abomination des Tempêtes','bete',1820,1400,1200,58,23,10,18,18,550,510,1,1,1,1,'','#14<5@_49;#14<5@_46',20,10667,3001,'hg2-1250;o12-5;o20-3',930,'','4','y','Amas difforme de glace et de pierre, vaguement humanoïde, l’abomination des tempêtes porte \r\nbien son nom. Parfois confondue dans la tempête avec un Yeti, de part sa hauteur, elle peut pourtant être \r\nfacilement reconnue : aussi large que haute, ses bras traînent au sol et laissent derrière elle des empreintes \r\nlinéaires qui entourent ses pas. D’une force herculéenne, il n’est pas rare de voir une abomination, d’un \r\nsimple mouvement inattentif, détruire des pierres et des murailles épaisses de plusieurs pieds.  \r\n\r\n'),(98,'lianes_chasseresses','Lianes Chasseresses','bete',1800,1450,1250,55,26,10,17,17,545,545,600,300,1,1,'','#10°recuperation@~96;#11°lien_sylvestreµ#14<3@~82;#14<5@~115',21,10839,3308,'hg2-1000;o22-5;o8-20',900,'','2','y','Plante vivante et vivace, les lianes chasseresses forment souvent un petit bosquet autour de leurs \r\nbases pour ne pas inquiéter leurs proies. A l’approche de celles-ci, elles se transforment rapidement en \r\ndes dizaines de bras tentaculaires pouvant attraper des créatures de taille appréciables. Une fois une liane \r\naccrochée a vous, il devient très difficile de fuir : en effet, à peine une liane coupée, d’autres viennent \r\nvous capturer et vous écarteler et vous tirent progressivement vers le pièges à mucilage ou vous serez \r\nlentement digéré des jours durant...  \r\n\r\n'),(99,'gorgone','Gorgone','magique',1900,1500,1200,58,22,10,17,17,545,545,500,1,350,1,'','#14<4µ#11°paralysie@~32;#13+paralysie@~146;#14<5@~126',21,10839,3308,'hg2-1000;o3-2',900,'','1','y','Jeunes femmes au corps de rêve, les gorgones sont des être démoniaques et immortels. Souvent \r\ndotés de grandes ailes dorées, celles-ci peuvent se déplacer sur de longues distances au dessus des plaines \r\net ne sont inquiétées que par de rares prédateurs aériens. Leur chevelure était constituée de serpents se \r\nmouvant au gré de leur humeur et de fines dents pointues ornent l’intérieur de leur bouche. Ajoutez à cela \r\nles griffes équipant le bout de leurs doigts et vous comprendrez le danger de cette vision de rêve. \r\n\r\n'),(100,'hurleur','Hurleur','bete',1920,1600,1400,61,24,10,16,16,560,560,500,1,350,1,'','#11°paralysieµ#14<1@~32;#11°appel_tenebreµ#14<1@~67;#10°posture@_110;#14<5@_103;#14<5@_81',22,11000,3631,'hg2-1666;hg3-10000;o19-40',870,'','7;11','y','Forme évoluée de la race des Banshees, les hurleurs sont formés au combat. Les sons qu\'ils \r\nproduisent leurs permettent de détruire des objets durs comme la roche, voire même, selon les dires de \r\ncertains, de voler. Alors qu’il commence sa mélodie, le bruit infernal vous rend incapable de penser, de \r\nbouger, mais alors que vous croyiez avoir atteint le summum de l’horreur, leur voix continue à monter \r\ncréchendo alors qu’ils se rapprochent et vos os implosent littéralement à l’intérieur de votre corps et dans \r\nune lente agonie vous ne pouvez plus qu’attendre que votre cœur éclate a son tour, grace que les Hurleurs \r\naccordent rarement à leurs victimes, les laissant inertes, mais conscientes, à même le sol. \r\n\r\n'),(101,'lezard_voltaique','Lézard Voltaïque','bete',1960,1600,1350,59,26,28,17,17,580,560,520,1,1,350,'','#10°posture@~110;#14<3@~164;#14<5@_81;#14<5@_103',22,11000,3631,'hg2-1666;hg3-10000;o8-40',870,'','4','y','Créature étrange des glaces, le lézard voltaïque n’a aucun mal à survivre dans ces contrées \r\ninhospitalières. Généralement de taille assez réduite, de l’ordre de 5 pieds, il est capable de provoquer de \r\nviolentes décharges à distance à tout prédateur qui l’importunerait. Son corps gris est entouré d’une aura \r\nbleutée d’électricité qui rend impossibles, ou du moins douloureuses, toute attaque directe contre lui. Peu \r\nagressif de nature, il préférera faire fuir ses adversaires en leur infligeant de faibles décharges plutôt que \r\nde déchaîner directement sur eux sa foudre, dans le sens premier du terme… \r\n\r\n'),(102,'harpie_vengeresse','Harpie Vengeresse','bete',1900,1650,1300,60,28,10,17,17,560,560,1,1,1,1,'','#10°posture@_106;#14<5@_103;#10°dissimulation@_113;#12+dissimulation@_115',22,11000,3631,'hg2-1666;hg3-10000;o16-20',870,'','6','y','Mi humain, mi oiseau, les harpies sont des êtres monstrueux nées il y a longtemps de la magie \r\nnoire. Celles-ci vivent au quotidien une douleur indicible, car le sort qui les a formé fut imparfait. Pour ce \r\nvenger de cette souffrance ordinaire, les harpies n’hésitent pas à enlever et dépecer de jeunes enfants aux \r\nabords des villages pour apporter le désespoir dans le cœur de cette civilisation qui les a fait naître. \r\nEquipées de serres effilées et dangereuse et d’un caractère acerbe elles n’ont que peu à craindre, alors, de \r\nla fureur des villageois. \r\n\r\n'),(103,'chevalier_errant','Chevalier Errant','humanoide',2000,1800,1350,66,28,10,18,18,575,575,1,1,1,1,'','#14<4@_81;#14<4@_79;#14<4@_85',23,11152,3968,'hg3-7000',840,'','1;2','y','Anciens aventuriers ayant servi le royaume dans les ordres de la chevalerie, ces hommes ont un \r\njour étés dépouillés de leurs titres et condamnés à l’exil. Parfois mercenaires, intrigants ou excros, la \r\nplupart se sont néanmoins reconvertis en chevaliers errants, recherchant l’aventure pour redresser les torts \r\net sauver l’orphelin au quatres coins du monde… Prompts à réagir et très suceptibles, les chevaliers \r\nerrants, forts de leurs expériences et de leurs équipements, sont de très redoutables adversaires et quête \r\nd’honneur et de gloire. \r\n\r\n'),(104,'hydre_a_7_tetes','Hydre à 7 Têtes','bete',2600,1900,1400,63,23,10,20,20,575,575,1,1,1,1,'','#10°posture@_107;#14<5@_102;#14<5@_81',23,11152,3968,'hg3-7500;o22-10',840,'','7;11','y','Créature des marais au corps difforme, l’hydre vit en général près des étendues d’eau.  Son corps \r\nmassif la rend très lente. A l’origine dotée de 3 têtes reptiliennes d’une vivacité fatale, les hydres à 7 têtes \r\nsont celles dont les têtes annexes on un jour été coupées : seule une des têtes gouverne son corps, et les \r\nautres se régénèrent en double une fois tranchées. Certains racontent avoir vu (de loin) des hydres \r\npossédant plus d’une dizaine de tête, mais l’hydre à 7 têtes est déjà suffisamment rare pour s’avérer très \r\ndangereuse. \r\n\r\n'),(105,'guerrier_chacal','Guerrier Chacal','bete',2100,1700,1400,62,25,10,17,17,575,585,1,1,1,1,'','#09=10@_84;#10°posture@_108;#14<5@_102;#14<5@_81',23,11000,3968,'hg3-7500;o26-4',840,'','3','y','Créatures humanoïdes au pelage jaune-roux, ces créatures du désert ressemblent à s’y méprendre à \r\ndes chacals, ce qui explique leur nom. Très habiles pour se dissimuler, ces guerriers sont les grands \r\nprédateurs du désert et se nourrissent de toutes les créatures qui l’habitent, y compris des voyageurs \r\nimprudents. Généralement armés de deux falchion ou de deux masses, revêtus d’une armure de cuir, ces \r\nnomades du désert sont rompus aux techniques de combats les plus expertes et sont de très dangereux \r\nadversaires. \r\n\r\n'),(106,'wyrm','Wyrm','bete',2400,1800,1450,72,24,10,15,15,550,550,1,1,1,1,'','#10°posture@_110;#14<5@_102;#14<5@_81',24,11294,4321,'hg3-6000;o21-5',810,'','1','y','Monstre filiforme aux couleurs chatoyantes, le Wyrm est un immense ver de terre ailé, \r\ncomparable à un dragon dépourvu de pattes avant. Créature discrète que peu de témoins racontent avoir \r\nrencontré, les mères utilisent souvent son image pour effrayer leurs petits : « Si tu n’est pas sage, le Wyrm \r\nviendra te manger ». A la fois synonyme de corruption et d\'effondrement de la nature, il représente le mal \r\nsous sa forme la plus vile. Doté d’une gueule impressionnante, sa mâchoire supérieure comprend deux \r\nrangées de dents et sa mâchoire inférieure une seule, ce qui lui permet de cisailler n’importe quel \r\nmatériau. Selon les milieux / saisons / sentiments de la Wyrm, sa peau change de couleur, méfiez vous du \r\nrouge, il est hors de contrôle ! \r\n\r\n'),(107,'minotaure','Minotaure','bete',2800,2000,1500,72,22,10,17,17,615,590,1,1,1,1,'','#09=10@_85;#10°posture@_108;#14<5@_83;#14<5@_81',24,11294,4321,'hg3-6000;o19-10',810,'','6','y','Créatures humanoïdes à tête de taureau, les minotaures se sont organisés en société et sont très \r\nintelligents. Des le plus jeune age, les jeunes sont formés de manière dure et violente, a laquelle peu \r\nsurvivent. Une fois adultes, ils se consacrent presque entièrement à la violence et à la défense de leur \r\nterritoire. S\'aventurer dans leurs régions vous permettra de trouver gloire et fortune, ou plus souvent la \r\nmort sous le coup de leurs coups. Inutile de tenter de parer leurs haches à deux mains, toute résistance \r\nserait futile ! \r\n\r\n'),(108,'bousier_royal','Bousier royal','bete',2700,1900,1500,69,23,10,17,17,590,590,1,1,1,1,'','#14<5@_83;#14<5@_79',24,11294,4321,'hg3-6000;o3-5',810,'','3','y','Vermine géante peu différente de son cousin le scarabée mutant, le bousier royal est capable de \r\nvoler sur de courtes distances. Contrairement à son homologue l’insecte, le bousier royal a des besoins en \r\nnourriture importants et ne peut se contenter de se nourrir d’excréments. Il s’attaque donc de temps a \r\nautres à d’autres créatures. Alors même que son repas est constitué d’un mélange d’excréments et de chair \r\nhumaine, chose peu ragoûtante, il a conservé l’habitude de rouler sa nourriture en pelote pour la déplacer \r\n\r\n'),(109,'ankheg','Ankheg','bete',2500,3000,1550,78,24,10,16,16,605,605,1,1,1,1,'','#10°posture@_107;#14<5@_102',25,11429,4689,'hg3-5000;o3-5;o19-10',780,'','1','y','Fabuleux insecte géant, l’ankheg tiens pour beaucoup de la mante religieuse. Doté de a six jambes, \r\nelle peut se mouvoir rapidement sur tout type de terrains et ses deux pattes avant, les « ravisseuses » ou \r\n« faucheuses » peuvent couper en deux quasiment tous les matériaux de Starshine. Son exosquelette \r\nextérieur, de couleur brune, est très résistant et difficile à trancher avec les armes classiques. En dernier \r\nrecours, une fois aculés, les Ankheg ont la possibilité de cracher de l’acide très corrosif. Si vous êtes \r\ntouché, débarrassez vous immédiatement du vêtement, voire du membre de votre corps incriminé, mieux \r\nvaux cela que de perdre la vie. \r\n\r\n'),(110,'etrangleur','Etrangleur','humanoide',2600,2000,1500,75,33,10,18,18,605,605,1,1,1,1,'','#09=10@_85;#14<5@_81',25,11429,4689,'hg3-5000;o19-5',780,'','6','y','Humanoïde des montagnes, mi-homme, mi-plante, l’étrangleur ressemble à un humain couvert de \r\nlianes. Son corps est constitué de nombreuses plantes grimpantes agissant indépendamment sous un \r\nmême esprit. Sorte de lianes chasseresses humanoïde, l’étrangleur peut surprendre l’aventurier non \r\naverti car il peut, d’une seconde a l’autre, changer radicalement de forme. Un bras de 5 pouces de \r\ndiamètres peut subitement se transformer en une masse de trois pieds de large au moment de vous \r\nfrapper ;  votre arme, qui venait de trancher un de ses membres, peut se retrouver soudainement emmêlé \r\ndans un amas de laines inexpugnable… \r\n\r\n'),(111,'berengei','Berengeï','bete',2840,2200,1550,79,23,10,18,18,605,605,1,1,1,1,'','#09=10@_85;#10°berzeker@_99;#10°posture@_108;#14<5@_81;#14<3@_102',25,11429,4689,'hg3-5000;o20-5',780,'','2','y','Singes géants des forêts, les berengeï vivent dans les plus grands arbres des forêts profondes. Les \r\nplus vieux et plus expérimentés parmi eux ont souvent le dos gris argenté, mais la plupart ont un pelage \r\nuniformément noir. Ne dépassant pas les 10 pieds de haut quand il se déplace, les berengeï peuvent \r\ndépasser les 15 pieds une fois redressés. L’envergure de leur bras peut dépasser les 25 pieds se qui les \r\nrends particulièrement impressionnants quand ils chargent. Une fois en colère, le berengeï vous \r\npréviendra de sa charge en frappant durement sa poitrine et en déracinant les arbres autour de lui, parfois \r\na dessin… Il est alors souvent plus que temps de prendre ses jamabes a son coup, en espérant que celui-ci \r\ntrouvera mieux a faire que de vous poursuivre et de vous enserrer dans son étreinte mortelle. \r\n\r\n'),(112,'araignee_dephasee','Araignée Déphasée','bete',2560,1900,1500,75,26,10,17,17,605,605,1,1,1,1,'','#10°posture@_111;#14<5@_83;#14<3@_79',25,11429,4689,'hg3-5000;o21-5',780,'','4','y','Pas beaucoup plus grandes que leurs homologues des glaces, les araignées déphasées tirent leur \r\nspécificité de leur possibilité de sortir de l’espace temps classique de manière instinctive. Reconnaissables \r\nà leur corps violacé, elles sont très difficiles à surprendre et n’attaquent souvent leurs cibles que dans le \r\ndos avant de changer de phase avant une quelconque riposte. Très patientes de nature, elles n’attaqueront \r\nleurs cibles qu’une fois assurées de la surprendre, renouvelant inlassablement leurs attaques jusqu\'à la \r\nmort de leurs victimes, qui ne tarde souvent pas étant donné la virulence du poison de leur dard. \r\n\r\n'),(113,'barghest','Barghest','bete',3000,1900,1600,74,28,10,19,19,605,605,660,1,400,1,'','#11°silenceµ#14<3@~29;#11°appel_tenebreµ#14<1@~69;#14<3µ#09<6@~177;#>@_83',25,11429,4689,'hg3-5000;o26-5',780,'','7;11','y','Redoutable prédateur des terres maudites, le barghest est un énorme canidé éthéré possédant des \r\ndents démesurées et des griffes titanesque. Cet animal maudit peut passer à volonté du monde des morts à \r\ncelui des vivants et prends tantôt une forme éthérée, tantôt une forme physique. Lorsqu’il charge, le \r\nbarghest ressemble à un nuage fantomatique avançant à raz le sol à une vitesse impressionnante. Une fois \r\nà portée de sa victime, il peut matérialiser au dernier moment une partie de son corps, généralement ses \r\nmâchoires, pour engager le combat. \r\n\r\n'),(114,'sphinx','Sphinx','magique',3200,2000,1600,72,25,40,22,22,605,605,700,1,1,400,'','#10°posture@~101;#14<3@~64;#14<5@~173;#14<5@~41;#14<3@~14',25,11429,4689,'hg3-5000;o16-3;o22-5;o26-10',780,'','3','y','Créatures immenses au corps géant de lion et à la tête d\'homme, les sphinx ne sont pas \r\nfoncièrement mauvais, ni malveillants… Les sphinx sont simplement des créatures centenaires qui \r\ns’ennuient en parcourant le monde de Starshine. Ils égayent donc classiquement leur quotidien en posant \r\ndes énigmes aux aventuriers qu\'ils rencontrent. Si ceux-ci trouvent la réponse, les sphinx les laisse partir, \r\nvoire discute avec eux amicalement un bout de chemin. Dans le cas contraire, les chances de finir ailleurs \r\nque dans l\'estomac de ces gigantesques créatures sont vraiment infimes ! \r\n\r\n'),(115,'seigneur_loup_garou','Seigneur Loup-garou','bete',3300,2200,1650,81,28,10,22,22,625,630,1,1,1,1,'','#10°berzeker@_125;#09=10@_85;#14<5@_83;#14<5@_81',26,11556,5071,'hg3-4000;o8-10;o20-5;o12-2;o3-2',750,'','1;2;3;4;6;7;8;11','y','Loup garou originel, ce seigneur est un être immortel qui tire sa puissance de magies depuis \r\nlongtemps oubliés. Alors que les êtres qu’il a mordus retrouvent le jour une apparence humaine, cet \r\nhumanoïde immense conserve sa forme à longueur de temps et ne perd jamais rien de sa soif de sang et de \r\ncarnage. La journée, il se terre dans les cavernes et les grottes, dans l’obscurité, pour se protéger du soleil \r\navant de ressortir reposé la nuit et entamer de nouveau une nuit de meurtres et de boucheries.  \r\n Beaucoup se ventent de l’avoir rencontré et terrassé en combat singulier. Certains sont de fieffés \r\nmenteurs, ou on simplement rencontré un de ses fils. Les rares qui l’ont vraiment affronté sont désormais \r\nfous et ne vivent guère longtemps, certains témoignages subsistent néanmoins : même un fois mort et \r\ndéchiqueté, celui-ci revient toujours vous hanter et se venger sur votre famille, et la famille de votre \r\nfamille avant de venir vous happer vous ! '),(124,'gatekeeper','Gatekeeper','magique',3000,1000,800,50,18,10,10,12,420,420,0,0,0,0,'','#10°posture@_21;#14<6@_80;#14<6µ#09=20@_55',16,15000,2251,'a41-10;hg1-10;hg2-20',0,'p25-282','15','n',''),(125,'construct_draconide','Construct draconide','magique',5000,1600,1100,47,21,30,16,21,450,500,560,0,0,350,'','#10°posture@~101;#14<6@~151;#14<5@~163;#14<5@~170;#14<4@~14',18,16000,2626,'hg2-10;p124-10',0,'','15','n',''),(126,'construct_draconide2','Construct draconide','magique',5000,1600,1100,47,21,30,16,21,450,500,560,0,350,0,'','#10°postureµ#14<6µ#11°paralysie@~95;#13+paralysie@~146;#11°poisonµ#14<5@~176;#13+poison@~140;#14<6@~128',18,16000,2626,'hg2-10;m13-10',0,'','15','n','');
