INSERT INTO `pnj` VALUES (1,'Belsine (petite fille d\'Alsine)','belsine',16,97,'[QUETEFINI49:9]\r\nJe reviens juste des ruines de Myriandre princesse. vous aviez raison, il se passe quelque chose d\'étrange là bas. Je me suis fait attaqué par un squelette, et j\'ai pu découvrir un journal qui a appartenu à un mage humain. tenez...\r\n[/QUETEFINI49:9]\r\n<i>Vous trouvez la jeune fille en pleur, le regard perdue dans le vide, comme tétanisée </i>\r\n[ID:1]Que se passe t\'il princesse ? ... princesse ?[/ID:1]\r\n*****\r\n<i>La jeune femme lève lentement le regard sur vous </i>\r\n- Le chaos, la mort, elles arrivent...\r\n<i>Elle regarde soudain autour d\'elle comme si elle prenait soudainement conscience de l\'endroit où elle se trouve </i>\r\n[ID:2]Que vous est il arrivé princesse ? Une vision ?[/ID:2]\r\n*****\r\n- Une vision si terrible que je ne puis l\'exprimer par des mots...\r\n[ID:3]Puis je vous aider en quoi que ce soit ?[/ID:3]\r\n*****\r\n- Je ne pourrais oser vous demander de prendre un si grand risque, ma vision était des plus flous, comme embrumée, mais j\'ai sentie un pouvoir terrifiant et un immense danger pour nous tous.\r\n[ID:4]J\'aimerais vous aider princesse, mais je ne me sens pas assez fort pour vaincre un tel danger.[/ID:4]\r\n[ID:5]Bah, peu m\'importe, cela n\'a aucune rapport avec moi[/ID:5]\r\n[ID:6]Si notre peuple est en danger, il est de mon devoir de faire tout ce qui en mon pouvoir pour le protéger.[/ID:6]\r\n*****\r\n- Vous envoyer sur cette mission serait vous envoyer à la mort, ne vous inquiétez pas, je trouverais quelqu\'un de plus expérimenté.\r\n[retour]\r\n*****\r\n- Vous n\'êtes pas digne de cette mission de toute façon... partez maintenant.\r\n[retour]\r\n*****\r\n- Je m\'en veux de vous envoyer sur une mission qui pourrait se réveler mortelle, mais votre courage oblige mon respect.\r\nEcoute, j\'ai pu reconnaitre les ruines de la ville humaine de Myriandre, qui se trouve au centre des royaumes, juste au nord d\'Aragonia, la capitale orc.\r\nElle fut détruite il y a quelques temps de cela par le dragon fou Arderax.\r\nJ\'ai des raisons de penser qu\'il y a quel que chose de plus dérrière tout ça, tu dois te rendre la bas et mener ton enquète avec la plus grande discétion, note toute chose qui sort de l\'ordinaire et reviens me voir.\r\nAu moindre danger, n\'hésite pas a faire marche arrière, il y a des aventuriers héroïques, et des aventuriers vivants, rarement les deux...\r\n\r\n[ID:7]Heu finalement cela a l\'air beaucoup trop dangereux, je préfere ne pas y aller, j\'en suis désolé[/ID:7]\r\n[ID:8]Je vous entend princesse, et il en sera fait comme vous le souhaitez.[/ID:8]\r\n*****\r\n- Ce n\'est pas grave, je comprend, c\'est effectivement très dangereux. Ne t\'inquiète pas je trouverais quelqu\'un d\'autre.\r\n[retour]\r\n*****\r\n[prendquete:49]\r\nMerci de votre aide !\r\n[retour]\r\n*****\r\n< la jeune femme saisie le journal et se met a rapidement feuilleter les pages >\r\n- c\'est bien ce que je craignais, il y a plus derrière la destruction de Myriandre que la simple vengeance d\'un dragon fou...\r\n[ID:10]- Qu\'est ce qu\'on peut faire pour en apprendre plus ?[/ID:10]\r\n*****\r\n- Hum, et bien il y a un Elfe des bois, Dryasaïde est son nom, c\'est un sage parmi les siens et un vieil ami de mon père. Si tu va le voir il saura te dire quoi faire.\r\n[ID:11]- Ou exactement pourrais je le trouver ?[/ID:11]\r\n*****\r\n- Et bien il vit plutôt en ermite, mais si tu parcours la forêt qui entoure le royaume de Loch\'jaden, tu devrais parvenir à le trouver.\r\n[ID:12]- Très bien princesse, je le trouverais et découvrirais ce qui se trame.[/ID:12]\r\n*****\r\n[prendquete:50]\r\n[retour]'),(2,'Argon','argon',12,173,'Que veux tu novice ?\r\nQui je suis ?\r\nComme si un simple nom suffisait pour t\'en dire plus sur moi... enfin...\r\nJe me nomme Argon, Archimage au service de sa majesté, je suis un adepte de l\'Art. J\'altère la réalité, et je la plie à ma volonté, tels sont les pouvoirs que j\'ai acquis au cours de plusieurs décennies de dur labeur.\r\n[retour]'),(3,'Elberg','elberg',135,112,'Le chaos, mon jeune ami... le chaos, c\'est la notion la plus importante de l\'univers.\r\nPourquoi un guerrier qui a remporté mille batailles finit il un jour perçé par la flèche d\'un simple goblin ? la malchance diront certains.\r\nLe Chaos te dira un Vörsh, car telle est la nature des choses : changeante. l\'ordre est une illusion figée, les certitudes ton pire ennemi, c\'est une vérité que tu devras accepter vite si tu veux survivre.\r\n[retour]'),(4,'Gorkush','gorkush',86,176,'Rhaaaaaaa\r\n<i>L\'orc fait tournoyer une énorme hache</i>\r\nQu\'est ce que tu veux !!!\r\n\r\n[ID:1]- Heu .... rien ...[/ID:1]\r\n*****\r\nRIEN, COMMENT CA RIEN ?\r\nTu me déranges pour rien ???\r\nTu vois cette hache, elle a appartenu a mon père, et a mon grand père avant lui, et il est dit qu\'un jour elle servira a terrasser un dragon !! mais peut être qu\'avant je vais la tremper dans ta colonne vertébrale pour aiguiser sa lame !!\r\n\r\n[ID:2]- Désolé de vous avoir importuné, je m\'en vais[/ID:2]\r\n*****\r\nOue c\'est ça dégage vermiceau... tu as de la chance que je sois dans un bon jour sinon je t\'aurais déja éparpillé.\r\n[retour]'),(5,'Jol\'angar','jolangar',184,79,'[QUETEFINI49:10]\r\n- Me voici vieux maître, je suis de retour des ruines de la ville humaine. il semble que ce soit là en effet que se trouve l\'origine du sort. tenez j\'y ai découvert ce journal sur le cadavre d\'un squelette qui m\'a attaqué.\r\n[/QUETEFINI49:10]\r\n<i>Le vieux skaven semble songeur, plongé dans ses pensées tandis qu\'il tise patiemment sur sa vieille pipe </i>\r\n[ID:1]Tout va bien vieux maître ?[/ID:1]\r\n*****\r\n- Hein, ha, non tout ne va pas bien, loin de là\r\n[ID:2]Que se passe-t il ?[/ID:2]\r\n*****\r\nHum, des fluctuations, voila ce qui se passe\r\n[ID:3]Heu, des fluctuations, voila, oui... ?[/ID:3]\r\n*****\r\nLes bases de la magie jeune novice ! Quand on lance un sort, on crée une perturbation dans le flux de mana, cet écho créer une résonance dans l\'espace astral\r\n[ID:4]des fluctuations ![/ID:4]\r\n*****\r\nExactement.\r\n[ID:5]Et quel est le problème ici ?[/ID:5]\r\n*****\r\nLe problème, c\'est que depuis quelques temps, je sens une résonance inhabituelle dans le champ astral... une résonance persistante, comme si un sort très puissant était maintenu.\r\n[ID:6]Vous pouvez déterminer quel type de sort[/ID:6]\r\n*****\r\nPar vraiment... c\'est ce qui est inquiétant. la résonance me parvient comme un vague écho, ce qui semble indiquer que le sort à a été lancé de très loin. et pourtant, rien que le fait que cela me parvienne jusqu\'ici est un indice de sa puissance... cela fait quelques temps que cela dure, et le phénomène va crescendo.\r\n[ID:7]Vous avez une explication ?[/ID:7]\r\n*****\r\nEt bien soit le sort prend de la puissance avec le temps... soit, et c\'est plus probable, la puissance du sortilège à été camouflée et c\'est le sort de camouflage qui perd de sa puissance, révélant petit à petit la puissance du vrai sortilège.\r\n[ID:8]Je vois, puis je vous aider a dévoiler ce mystère ?[/ID:8]\r\n*****\r\net bien si tu le souhaites, oui, j\'ai réussi a déterminer approximativement la source du sort, je l\'ai localisé a proximité de l\'ancienne ville humaine de Myriandre. Rend toi la bas, et essaye de localiser d\'où pourrait provenir cette perturbation du champ magique.\r\n[ID:9]Très bien vieux maître, je viendrais vous faire mon rapport.[/ID:9]\r\n*****\r\nBonne journée !\r\n[prendquete:49]\r\n[retour]\r\n*****\r\n< Le vieux sorcier prend le journal en main et feuillette lentement les pages une à une. Une fois cela terminé, il reste pensif un moment. > \r\n- Un sort d\'illusion camouflé...\r\n[ID:11]- Oui, cela ne nous apprend pas grand chose de neuf n\'est ce pas?[/ID:11]\r\n*****\r\n- Détrompe toi, il y a beaucoup à apprendre dans ce livre pour celui qui sais voir...\r\n[ID:12]- comment ça ?[/ID:12]\r\n*****\r\n- Ha les jeunes, vous entendez mais vous n\'écoutez pas, vous voyez, mais vous ne comprenez pas... enfin... il y a un vieux confrère à moi, un elfe des bois, Dryasaïde, il vit dans la forêt au nord-est de Keleth . si tu veux avoir une chance de voir ce qui se cache derrière le sortilège, tu devras aller le trouver et suivre ses conseils...\r\n[ID:13]- J\'imagine que vous ne m\'en direz pas plus ?[/ID:13]\r\n*****\r\n- Ha, enfin une remarque emprunte de sagesse\r\n< le vieux skaven sourit > \r\n[prendquete:50]\r\n[retour]'),(6,'Anredür','anredur',74,152,'[QUETEFINI49:6]\r\nTenez j\'ai découvert ce journal.\r\n[/QUETEFINI49:6]\r\n<i>L\'ombre semble quel que peu perturbée, son regard, songeur, se perd dans le vide. Intrigué, vous vous approchez.</i>\r\n[ID:1]Quelque chose ne va pas ?[/ID:1]\r\n*****\r\nHumm... des questions qui appellent des réponses, qui appellent d\'autres questions...\r\n[ID:2]Hein ?[/ID:2]\r\n*****\r\n<i>Le spectre lève les yeux sur vous, comme si il venait seulement de vous apercevoir</i>\r\nHa c\'est vous, il se passe des choses, des choses qui demandent des confirmations, j\'ai comme une sensation étrange, familière... se pourrait il que... hum\r\n[ID:3]Si vous me disiez ce qui se passe, peut être pourrais vous être utile en quoi que ce soit ? [/ID:3]\r\n*****\r\nHa, méfie toi, tu pourrais être exaucé bien au delà de tes désirs... mais oui tu peux peut être m\'être utile, si tu t\'en sens le courage novice !\r\n[ID:4]Je suis courageux.[/ID:4]\r\n*****\r\nMaintenant oui peut être... tu est si candide... enfin, peut être est ce que cela suffira, je ne peux pas me permettre de faire la fine bouche. Il y a une cité au coeur du continent, une cité ravagée, qui se nomme Myriandre... Tu dois t\'y rendre, une fois la bas tu parcouras ses ruines avec la plus grande prudence et tu me rapporteras tout ce qui peux te paraître sortir de l\'ordinaire.\r\n[ID:5]J\'y vais et je me promène... et c\'est tout ?[/ID:5]\r\n*****\r\nNous verrons bien si tu est à la hauteur de cette tache déjà... mais méfie toi, si mes craintes se trouvent confirmées, il se pourrait que ta mission soit bien plus périlleuse qu\'il n\'y parait... va maintenant, et essaye de revenir en un seul morceau.\r\n[prendquete:49]\r\n*****\r\n<i>le spectre passe sa main sur le journal, une faible lueur s\'en dégage soudain. Anredür prend un air songeur </i>\r\n[ID:7]Est ce que cela confirme ce que vous redoutiez ?[/ID:7]\r\n*****\r\nJ\'en ai peur oui.\r\n[ID:8]Quelle sera la suite des évènements ? \r\n[/ID:8]\r\n*****\r\nHa, te voila bien pressé de courir vers ta mort... enfin ! Il y a un mage elfe qui vis au nord-est de la forêt qui entoure le royaume des elfes des bois. Tu dois aller le voir, il connaît notre affaire et pourra sûrement t\'aider si tu lui en parle.\r\n[ID:9]Très bien j\'irais voir cet elfe...[/ID:9]\r\n*****\r\nEt hum soit prudent,il se peut qu\'il soit devenu un peu susceptible avec l\'âge.\r\n[prendquete:50]'),(7,'Torkuz L\'abomination','torkuz',69,87,'[ID:1]- ...[/ID:1]\r\n*****\r\nNe sois pas effrayé, je me nomme Torkuz, autrefois un puissant guerrier, puissant... et vaniteux...\r\nJ\'ai cru pouvoir me dresser façe à la puissance des dieux. Autrefois j\'ai cru pouvoir me mesurer à Cemiros lui même durant une grande bataille... il m\'a brisé sans même y prêter attention, détruisant mon corps, pulvérisant mon âme même. Mais dans sa grande mansuétude, le changeur m\'a offert une nouvelle chance de le servir, et aujourdhui j\'attend mon heure...\r\n[retour]'),(8,'Kul\'tar','kultar',57,33,'La Hache et le sang ! voila le sens de la vie.\r\nLe combat est partout, des guerres, il y en a toujours eu, il y en aura toujours. Mon royaume a autrefois été très puissant, puis les miens ont été réduit en esclavage, aujourdhui nous retrouvons notre forçe d\'antan, les choses changent, un cycle, voila ce que c\'est, aujourdhui je vis, demain je meurt.\r\nGrumf, voila pourquoi je goute chaque moment, voila pourquoi je vis chaque combat... car chacun d\'entre eux pourrait être le dernier !\r\n[retour]'),(9,'Alkor','alkor',19,51,'Ne discute jamais avec un elfe, ne marchande jamais avec un nain, ne te bat jamais avec un troll, ne contrarie jamais un barbare, ne joue jamais aux cartes avec un humain, ne discute jamais théologie avec un skaven,ne tourne jamais le dos à un Vörsh et surtout, surtout, ne fais jamais confiance à un dragon...\r\n[retour]'),(10,'Loktar double lame','locktar',121,18,'[QUETEFINI49:8]\r\n- Je me suis rendu sur les ruines de Myriandre et j\'ai effectivement noté des évènements étranges... et le fait que j\'ai été attaqué par un squelette n\'est pas le moindre d\'entre eux... j\'ai d\'ailleurs aussi découvert ce journal, tenez....\r\n[/QUETEFINI49:8]\r\n<i>L\'elfe des bois vous interpelle </i>\r\nHey toi là, oui toi, viens là !\r\n<i> Le guerrier semble vous observer de la tête aux pieds </i>\r\nOué bon, j\'imagine qu\'il faudra bien que cela fasse l\'affaire... j\'ai besoin de quelqu\'un pour une mission importante... quelqu\'un de rapide et de discret, c\'est une mission de reconnaissance.\r\n[ID:1]Heu non désolé ça ne m\'intéresse pas.[/ID:1]\r\n[ID:2]Ha et en quoi consisterait cette mission ?[/ID:2]\r\n*****\r\n[retour]\r\n*****\r\nTu a certainement du apprendre les ravages que le dragon Arderax a causé à la cité humaine de Myriandre. On dit qu\'il l\'aurait complètement ravagée...\r\n[ID:3]Heu vaguement... et donc ?[/ID:3]\r\n*****\r\nEt bien il se trouve que je connaissais quelques un des guerriers qui étaient chargés de la défense de la ville. De bon stratèges... et une ville de cette importance contenait aussi forcément de puissants magiciens. Je connais la puissance des dragons, qui n\'a d\'égale que leur arrogance, mais je ne saurais croire qu\'un dragon seul est parvenu a vaincre les défenses entières d\'une ville aussi importante.\r\n[ID:4]Je comprend ce que vous voulez dire, et que voulez vous que je fasse ?[/ID:4]\r\n*****\r\nJe cherche quelqu\'un qui puisse se rendre sur les ruines de la cité, afin de noter tout ce qui peux s\'y passer d\'anormal, et le cas échéant, essayer de découvrir ce qui a pu se produire durant cette attaque. J\'ai besoin de quelqu\'un qui sache se servir aussi bien de ses muscles que de son cerveau...\r\n[ID:5]Hum, ça m\'a l\'air assez dangereux, je préfère rester ici ![/ID:5]\r\n[ID:6]Hum, très bien je suis votre homme, j\'irais enquêter sur les ruines de Myriandre, cela m\'intrigue.[/ID:6]\r\n*****\r\n[retour]\r\n*****\r\n[ID:7]Très bien, peux être fera on quelque chose de vous finalement, vous savez ou se trouve Myriandre n\'est ce pas ? les ruines se trouvent au centre des royaumes, entre les grand lacs.[/ID:7]\r\n*****\r\nAu revoir !\r\n[prendquete:49]\r\n*****\r\n< L\'elfe jette un rapide coup d\'oeil au journal >\r\n- Grr un sort d\'illusion, il ne manquait plus que ça, et il a l\'air plutôt coton en plus...\r\n< l\'elfe réfléchit un moment >\r\n- Attend, il y a bien ce vieil Ermite qui vit dans la forêt... son nom m\'échappe, dyadis, dryasis ou un truc du style... toujours est il que c\'est un mage spécialisé dans les sortilèges de ce type. Si tu arrives à mettre la main dessus, peut être pourra il nous en apprendre plus long sur cette histoire.\r\n[ID:9]- Dans la forêt vous dites ? bien ça ne devrait pas être trop dur de mettre la main sur lui.[/ID:9]\r\n*****\r\n[prendquete:50]\r\n[retour]'),(11,'Jarod Sharpfinger','jarod',166,168,'[QUETEFINI49:6]\r\n- Je suis de retour des ruines de Myriandre. Aucune trace la bas de l\'unité aigle mais j\'ai pu retrouver ce journal qui a appartenu à un de leur membre, lisez le, vous verrez, cela nous en dis long...\r\n[/QUETEFINI49:6]\r\n[ID:1]Je suis passé à l\'université maître, et j\'ai lu le journal de frankriss Hawkeye... Que signifie tout ceci ?[/ID:1]\r\n*****\r\nFrankriss est... ou plutôt était... un membre de l\'unité Aigle. c\'est une unité chargée de certaines missions de reconnaissance pour le service de renseignements de sa majesté. Il était en mission à Myriandre après l\'assaut du dragon Arderax.\r\n[ID:2]Myriandre ?[/ID:2]\r\n*****\r\nMyriandre est une cité humaine. une cité état, indépendante du royaume de Lordaeris, une ville marchande assez importante... elle a été attaquée par le dragon fou Arderax qui l\'a tout simplement ravagée sans qu\'on puisse faire quoi que ce soit. la ville a dis on été entièrement détruite... il est d\'usage dans ce genre de situation d\'envoyer une unité d\'éclaireurs afin de déterminer si il y a lieu d\'envoyer de l\'aide, ou a défaut évaluer l\'impact stratégique sur la région de ce genre de situation...\r\n[ID:3]Et que c\'est il passé ?[/ID:3]\r\n*****\r\nC\'est la le mystère. Un groupe de pillards a récupérer le journal de hawkeye au bord des ruines, aucune trace de l\'unité aigle ou même de corps. les pillards se sont dis qu\'ils pourraient en tirer un bon profit en venant nous le vendre.\r\n[ID:4]Je vois... en quoi puis je vous aider ? [/ID:4]\r\n*****\r\nL\'unité aigle a disparue, c\'est un groupe aguerri, et ce qui en est venu a bout pose un danger potentiel au royaume que nous devons absolument déterminer.\r\nLà ou un groupe entier à échoué, peut être qu\'un individu pourra réussir. La discrétion peut prévaloir là ou la force armée est inutile. je veux que vous vous rendiez sur les ruines de la cité de Myriandre, qui se trouve au centre des royaumes, et que arriviez a déterminer ce qui s\'y passe, et si possible ce qui est arrivé à l\'unité aigle.\r\n[ID:5]Je comprend, le temps de me préparer et je me met en route.[/ID:5]\r\n*****\r\nBonne route !\r\n[prendquete:49]\r\n*****\r\n< Le vieux nain saisit le journal et lit patiemment chaque page, une fois qu\'il a finit, il pousse un soupir triste >.\r\n- C\'est terrible, il y a fort a parier que l\'unité aigle a périt... il se passe à Myriandre des choses fortes étranges sous le couvert d\'un sortilège de protection apparemment... Hum, laisse moi réfléchir... Il y a un vieux mage elfe, il vit dans la forêt qui entoure Keleth, la capitale des elfes des bois. On dis qu\'il est spécialisé dans les sortilèges d\'illusion... Si quelqu\'un est a même de t\'aider a percer ce sort, c\'est bien lui, tu dois aller le trouver et tenter de percer ce mystère... nous devons bien ça à l\'unité aigle.\r\n[prendquete:50]\r\n[retour]'),(12,'Dryasaïde','dryasaide',38,61,'[QUETEFINI51:4]J\'ai fini de tuer tous les monstres[/QUETEFINI51:4]\r\n[QUETEFINI52:5]J\'ai tué tous les ennemis à mon royaume[/QUETEFINI52:5]\r\n[QUETE53-0:6]J\'ai rammené tous les ingrédients[/QUETE53-0:6]\r\n[QUETE50-0:1]- Ha, encore un... ne me dis rien, je sais déjà pourquoi tu est là... tu n\'es pas le premier...\r\n[ID:1]- Vous allez pouvoir m\'aider alors ?[/ID:1]\r\n[/QUETE50-0:1]\r\n*****\r\n- T\'aider ? pourquoi est ce que je t\'aiderais... Qu\'est ce qui te fais seulement croire que tu es capable de survivre à ce qui se cache derrière ce sortilège ?\r\n[ID:2]- Heu... je...[/ID:2]\r\n*****\r\nBlablabla tu ne sais rien...Si veux aller plus loin, il va falloir que tu me montres de quoi tu es capable... pour commencer tu va aller te mesurer à certains membre de la faune locale histoire de voir ce que tu vaux...Tues moi un lapin, un renard gris, un serpent, une nuée de moustiques, un scarabée géant et un puma. Quand tu te seras défait des ces adversaires, ramène m\'en la preuve et nous verrons pour la suite.[ID:3]Ok ![/ID:3]\r\n*****\r\n[quete]\r\n[prendquete:51]\r\nTchao ![retour]\r\n*****\r\n- Hum pas mal... mais bon tu a prouvé que savais pister des animaux, mais qu\'est ce que tu vaux face à un adversaire à a ta mesure, est ce que tu sauras faire preuve de l\'ingéniosité et de la force nécessaire pour tuer un des tes semblables ? Si tu veux m\'en faire la preuve, tu devras affronter six adversaires de ta race qui soient approximativement de la même force que toi... à ce moment là tu pourras revenir me voir.\r\n[prendquete:52]\r\n*****\r\n- Hum, peut être qu\'après tout, tu n\'es pas juste bon a nourrir les manticores...\r\n[ID:7]- Ha on va peut être enfin pouvoir parler du sortilège qui sévit sur Myriandre...[/ID:7]\r\n*****\r\nVous pouvez maintenant entrez et découvrir les secrets de myriandre !\r\n[verifinventaire:53]\r\n*****\r\n- La fougue de la jeunesse ! mais méfie toi, quoi que ce sortilège camoufle, il a été lancé par quelqu\'un avec un pouvoir énorme ! j\'ai rarement vu une trame de sort aussi élaborée... mais elle commence déjà a s\'effriter, et celui, ou celle, qui l\'a lancé, ne prend pas la peine de le renforcer. Peut être n\'est il déjà plus sur place... ou peut être pas...\r\n[ID:8]- Y a t il un moyen d\'annuler le sortilège ?[/ID:8]\r\n*****\r\n- Vaincre ce sortilège demanderait l\'association de certains des mages les plus puissants des royaumes... avec plusieurs semaines devant eux... et sans l\'assurance d\'y arriver... mais rassure toi, pas besoin de détruire ce sort, il te suffira de le contourner !\r\n[ID:9]- et par quel miracle vais je réussir cela ?[/ID:9]\r\n*****\r\n- En théorie c\'est simple, il te suffit d\'harmoniser ton aura à celle du sort afin qu\'il ne te reconnaisse pas comme une cible de l\'illusion !\r\n[ID:10]- ça a l\'air simple comme ça ... en général il y a toujours un Mais...[/ID:10]\r\n*****\r\n- Et bien pour y parvenir il te faudra porter un artefact fait par mes soins qui se chargera de modifier ton aura. Et pour cela il va falloir que tu me réunisses quelques ingrédients : il va me falloir une potion de vie mineure, une baguette munie d\'un emplacement, et un parchemin. Une fois tout cela réuni je te fabriquerais l\'artefact qui te permettra de voir ce qui se passe réellement à Myriandre.\r\n[prendquete:53]');
