INSERT INTO `quete` VALUES (1,'Le ragoût de lapin','Mon fournisseur habituel est souffrant aujourd\'hui, ça vous dirait pas de vous faire quelques pièces facilement ? <span class=\"small\">*le tavernier vous observe en grommelant *</span> ...Moué, je vous enverrais bien me chercher quelques steack de guépard mais je dois vous avouer que vous m\'êtes plus utile vivant... Enfin bon, ma spécialité, c\'est le ragout de Lapin, essayez de m\'en ramener une quinzaine que je puisse préparer le prochain repas de tous ces affamés et je vous filerai un petit quelque chose en récompense.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M1\";s:6:\"nombre\";i:15;s:6:\"requis\";s:0:\"\";}}',225,15,45,'','y','g','',0,0,'',1,1,'oui'),(2,'Sérum à base de venin de serpent','Vous m\'avez l\'air plus gaillard que la dernière fois, vous prenez de la bouteille ça se voit ! Ca tombe bien avec tous ces serpents qui trainent, on tombe à court de serum ces derniers temps, vous rendriez un fier service si vous pouviez ramener des glandes de poison de serpent afin de préparer plus de serum.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M3\";s:6:\"nombre\";i:30;s:6:\"requis\";s:0:\"\";}}',3000,240,390,'','y','g','',0,0,'',200,3,'oui'),(3,'Ours noirs','Vous nous rendriez trois fois service en allant chasser ces saletés d\'ours noirs ... déjà vous éliminez une menace pour nos concitoyens, plusieurs voyageurs se sont fait attaquer récemment dans le coin. En plus si vous vous y connaissez un peu, leur fourrure est plutôt recherchée par les tanneurs, et enfin, même si c\'est pas la meilleure, le tavernier payera un petit prix si vous lui ramener quelques bon morceaux de leur chair .. trop relevé au goût pour moi, mais il paraît que ça a ses adeptes ... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M5\";s:6:\"nombre\";i:10;s:6:\"requis\";s:0:\"\";}}',2600,220,330,'','y','g','',0,0,'',1000,5,'oui'),(4,'Araignées géantes','Mouais, je sais que je vous demande pas d\'aller faire un pique nique en forêt, mais là il nous faut vraiment quelqu\'un de costaud ... les araignées géantes commencent à pulluler dans les environs... elles ne sont pas vraiment hostiles en temps normal mais comme il y a une sorte de surpopulation en ce moment, elles commencent à devenir agressives... du coup il faudrait aller... hum... réguler leur espèce comme on dit, histoire que les choses reprennent leur cours normal. \r\nLa paye sera à la mesure de la mission évidemment ! ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M6\";s:6:\"nombre\";i:20;s:6:\"requis\";s:0:\"\";}}',8000,860,1320,'','y','g','',0,0,'',2100,7,'oui'),(5,'L\'invasion des belettes','Je vous jure ! Plein mon poulailler que j\'en ai ! Des vrais saloperies, et la garde qui me rigole au nez quand je leur en parle, il faut que quelqu\'un fasse quelque chose ... C\'est pas un truc bien héroïque mais si vous m\'en débarassez, je saurais être génereux .. et faites gaffe, ces sales bestioles mordent ...','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M7\";s:6:\"nombre\";i:8;s:6:\"requis\";s:0:\"\";}}',120,8,24,'','y','g','',0,0,'',1,1,'oui'),(6,'Chasse aux renards','rhaa toi là viens ici !! oué toi ... écoute ça te dis de te faire un peu de blé rapide ? écoute, une saloperie de renard s\'est encore glissé dans mon poullailler durant la nuit... l\'enclos, les pièges rien y fait... j\'ai essayé la dissuasion, il est temps de passer à la manière forte... c\'est simple tu me débarasses des ces bestioles, et je te file ton blé... alors on tope ?','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M2\";s:6:\"nombre\";i:8;s:6:\"requis\";s:0:\"\";}}',320,32,56,'','y','g','',0,0,'',20,2,'oui'),(7,'Chasse aux Guépards','On a toujours eu des Guépards dans la région mais en géneral ils ne s\'attaquent pas a nous. Ces derniers temps on a eu plusieurs rapports d\'attaques sur des marchands ou des paysans, la garde patrouille mais on ne peux pas être partout, a mon avis ces bestioles ont trop pris confiance, il est temps de leur rappeler ou s\'arrête leur territoire ! On m\'a soufflé votre nom comme étant a la hauteur, on va bien voir ce que vous valez ... tuez moi 12 de ces saletés et vous ne le regretterez pas.','ecole_combat','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M9\";s:6:\"nombre\";i:12;s:6:\"requis\";s:0:\"\";}}',3000,450,600,'','n','g','',0,0,'',250,4,'oui'),(8,'D\'effrayants Loup-garou','Comme je vous vois je vous dis, un Loup-garou je vous jure... un truc a vous faire dresser l\'echine... je suis pas payé pour me faire tailler en rondelles moi ! Mais bon le capitaine là avec ses grand airs, il donne les ordres et il reste bien au chaud a l\'abri... si vous êtes assez fou... heu... courageux, vous pourriez peut-être essayer de nous en débarasser... hein ça vous dis ?','ecole_combat','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M4\";s:6:\"nombre\";i:1;s:6:\"requis\";s:0:\"\";}}',1000,100,250,'','y','s','',0,0,'',3000,9,'oui'),(9,'Besoin d\'eau de vie urgent !','La ville a un énorme besoin d\'eau en ce moment et nous savons que les Cactus géant qui traine dans les parrages sont une grosse réserve d\'eau.\r\nTuez en 5, cela devrait pouvoir nous sauver pour le moment.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M13\";s:6:\"nombre\";i:5;s:6:\"requis\";s:0:\"\";}}',2000,300,650,'','y','g','',0,0,'',2800,8,'oui'),(10,'Le sérum','Tiens vous voilà, justement je vous cherchais, notre guérisseur est à court d\'ingrédients pour préparer ses baumes, et je me disais qu\'un gars comme vous, toujours à la recherche d\'aventure, pourrait être interessé...\r\nCe qu\'il lui faut surtout ce sont des glandes de scorpions pour préparer des anti-poisons, si vous vous sentez le courage, ramenez en 5, il n\'est pas ingrat vous verrez','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M8\";s:6:\"nombre\";i:5;s:6:\"requis\";s:0:\"\";}}',75,5,15,'','y','g','',0,0,'',1,1,'oui'),(11,'Chasse aux Pingouins','De la graisse de pingouin voila ce qu\'il me faudrait... Un bail que je suis pas parti à la chasse pour en ramener... mais avec tout le boulot que j\'ai ici, j\'ai plus vraiment le temps *soupirs*, des fois je me dis que je ferais mieux de tout plaquer... Enfin bon je disais que la graisse de Pingouin c\'est l\'idéal pour la cuisine ... et justement je me disais que vous pourriez aller chasser quelques uns de ces oiseaux pour moi, histoire d\'améliorer la bouffe du coin... Evidemment je vous paierai !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M10\";s:6:\"nombre\";i:10;s:6:\"requis\";s:0:\"\";}}',150,10,30,'','y','g','',0,0,'',1,1,'oui'),(12,'Je vous donne du monsieur','Oué c\'est sur vous avez réussi, on peux dire que je m\'attendais pas a ce que vous progressiez aussi vite, on parle de vous en haut lieu... Mais croyez moi vous avez pas fini d\'apprendre, je veux dire vous êtes fort et tout, mais est ce que vous vous êtes déja mesuré a un Griffon ??? parce que ça c\'est le vrai défi... un Griffon mon gars, ya pas plus dangereux et majestueux aux alentours... Mais là si vous réussissez ce coup là, je vous donne du monsieur c\'est sur !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M15\";s:6:\"nombre\";i:10;s:6:\"requis\";s:0:\"\";}}',14000,3500,2667,'','y','g','',10,0,'',9300,14,'oui'),(13,'Chasse aux Worgs','On a toujours eu des Worgs dans la région mais en géneral ils ne s\'attaquent pas a nous. Ces derniers temps on a eu plusieurs rapports d\'attaques sur des marchands ou des paysans, la garde patrouille mais on ne peux pas être partout, a mon avis ces bestioles ont trop pris confiance, il est temps de leur rappeler ou s\'arrête leur territoire ! On m\'a soufflé votre nom comme étant a la hauteur, on va bien voir ce que vous valez... tuez moi 12 de ces saletés et vous ne le regretterez pas.','ecole_combat','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M16\";s:6:\"nombre\";i:12;s:6:\"requis\";s:0:\"\";}}',3000,450,600,'','n','g','',0,0,'',250,4,'oui'),(15,'Lézard','<l\'homme marmonne alors que tu rentres dans la pièce> ... une once de mandragore, deux  oeufs de caille, dix queues de ... Rhaaa non, c\'est pas possible ... < le regard du vieil homme se lève et se pose sur toi >. Ha ! Tiens vous tombez bien vous. J\'imagine que ça vous tente de vous faire un peu d\'argent ? Bon il faut que vous me récupériez dix lézards, qui rentrent dans la composition de certaines de mes potions, vous en trouverez à foison dans les marais des environs.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M30\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',150,10,30,'','y','g','',0,0,'',1,1,'oui'),(16,'Salamandre','Oui, c\'est pour quoi ? Vous cherchez du travail ? ... hum écoutez j\'ai peut être quelque chose à vous proposer. Il se trouve que mes recherches sur le feu élémentaire piétinent un peu.\r\nLes salamandres possèdent une glande qui sécrète une substance dont les propriétés s\'en rapprochent, si je pouvais en avoir en quantité, ça me permettrait sûrement d\'avancer. Aussi, si vous pouviez aller m\'en chasser quelques unes, vous vous feriez quelques pièces facilement.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M31\";s:6:\"nombre\";s:2:\"12\";s:6:\"requis\";s:0:\"\";}}',180,12,36,'','y','g','',0,0,'',1,1,'oui'),(17,'Les renards gris','La peau de renard est assez prisée par les tanneurs, mais celle des renards gris l\'est encore plus, et je connais quelques types qui seraient prêt à payer un paquet de fric pour mettre la main sur quelques unes d\'entre elles. Donc si tu marches avec moi, tu va te charger d\'en récolter quelques unes, tu me les rapportes, et je paye ta part de la vente.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M32\";s:6:\"nombre\";s:1:\"8\";s:6:\"requis\";s:0:\"\";}}',320,32,60,'','y','g','',0,0,'',20,2,'oui'),(18,'Puma','hum, les pumas commencent a constituer une nuisance pénible dans les environs. Ce genre de félin est plutôt agressif, surtout quand il défend son territoire.  Nous recrutons quelques aventuriers courageux histoire de sécuriser les montagnes du coin. Le risque existe, mais c\'est plutôt bien payé et ça ne devrait pas vous prendre trop de temps je pense. \r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M34\";s:6:\"nombre\";s:1:\"8\";s:6:\"requis\";s:0:\"\";}}',2040,162,250,'','n','g','',0,0,'',250,4,'oui'),(19,'Goblins','Hum .. les goblins commencent à poser un sérieux problème dans les montagnes environnantes ... ils avaient été plutôt calme ces derniers temps mais là, ça fait déjà plusieurs rapports de caravanes qui nous signalent avoir été attaqués par ces foutus goblins. Il s\'agirait de leur donner une bonne correction pour leur passer l\'envie de venir s\'attaquer a nous, et de retourner sagement dans le trou du cul de leur montagne, si vous voyez ce que je veux dire... enfin bref, on est prêt à engager quelques type de valeur histoire de s\'occuper de l\'affaire rapidement, si ça vous tente ... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M35\";s:6:\"nombre\";s:2:\"20\";s:6:\"requis\";s:0:\"\";}}',5100,450,680,'','y','g','',0,0,'',1000,5,'oui'),(20,'Zombie','la plupart du temps, les zombies sont la résultante d\'un sortilège nécromantique, ou bien d\'une aberration magique ... toujours est il qu\'il arrive que ces zombies persistent même après la fin du sort, et c\'est là qu\'ils commencent à poser problème car ils ne sont plus sous contrôle...on recrute donc quelques aventuriers histoire d\'aller mettre un terme à leur ... mort. Vous les trouverez dans les marais autour de la ville... débarrassez nous en et vous n\'aurez pas perdu votre journée croyez moi. Faites attention, ce n\'est pas parce qu\'ils sont déjà mort qu\'ils ne sont pas dangereux !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M36\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}} ',5000,440,700,'','n','g','',0,0,'',500,5,'oui'),(21,'Dryade','les dryades ont une particularité remarquable, du fait qu\'elles sont en partie végétales et en partie animales. C\'est ce qui offre des perspectives absolument fascinantes pour leur étude ... si vous pouviez me fournir plus particulièrement quelques sujets à ... hum .. disséquer .. je saurais vous en être plus que reconnaissante. ','magasin','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M19\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',3400,280,400,'','n','g','',0,0,'',250,4,'oui'),(22,'Renard du désert','Oué on appel ça des renards du désert, vous avez sûrement dû déjà en voir roder dans les environs. C\'est ceux qui ont un pelage tacheté, avec des reflets du plus bel effet. Toujours est il que je cherche du monde qui puisse en chasser quelques uns, afin que je puisse utiliser leur fourrure pour mes tapis. Si ça vous intéresse, dites le moi, j\'offre une prime modeste, mais intéressante par rapport a la difficulté de la tache. \r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M49\";s:6:\"nombre\";s:2:\"13\";s:6:\"requis\";s:0:\"\";}}',4420,364,520,'','n','g','',0,0,'',250,4,'oui'),(23,'Fourmis soldats','Bon ben voilà que maintenant notre entomologiste veut des spécimens de fourmis-soldats ... je vous préviens, ce sera une autre paire de manche que la dernière fois... mais du coup la prime sera d\'autant plus élevée. Faites bien attention, ce genre de bestiole a les pinces acérées comme des épées. ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M23\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',3200,320,500,'','y','g','',0,0,'',1500,6,'oui'),(24,'Faucons','Ola, on recherche quelques jeunes courageux afin de faire le ménage dans la population de faucons !! Ces redoutables prédateurs sont en train de ravager la population de lapin des environs, et il serait temps que quelqu\'un s\'en occupe. La récompense sera à la hauteur de la tâche !\r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M20\";s:6:\"nombre\";s:2:\"15\";s:6:\"requis\";s:0:\"\";}}',600,60,105,'','y','g','',0,0,'',20,2,'oui'),(25,'Fourmis ouvrières','On cherche quelqu\'un pour ramener des fourmis ouvrières pour un entomologiste.  Moi les insectes, j\'en ai rien a battre, mais ce mec là il est prêt à payer sonnant et trébuchant pour qu\'on lui fournisse des sujets d\'étude, alors bon si ça vous intéresse de partir à la chasse aux fourmis hein ... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M22\";s:6:\"nombre\";s:2:\"15\";s:6:\"requis\";s:0:\"\";}}',1500,120,195,'','y','g','',0,0,'',200,3,'oui'),(26,'Chameaux','Rhoo mais la chair de chameau est extrêmement savoureuse, et je me fais fort de vous le prouver ! < le regard du tavernier se pose sur vous > TIENS TOI ! Ca te dis de te faire de la tune facilement ? Si t\'es capable de me ramener quelques chameaux histoire que je prépare à tous ces saoulards le meilleur plat qu\'ils aient jamais mangé ?? ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M21\";s:6:\"nombre\";s:1:\"8\";s:6:\"requis\";s:0:\"\";}}',480,48,84,'','y','g','',0,0,'',15,2,'oui'),(27,'Crocodile','Il s\'agirait en fait de récupérer des peaux de crocodile. Il y a une grosse demande de ce genre de produit en ce moment du coté des tanneries, que ce soit pour créer des tuniques ou encore pour recouvrir des boucliers. Evidemment, se débarrasser de ces sac à main n\'est pas une mince affaire, mais vous m\'avez l\'air plutôt doué dans votre domaine et il y a une bonne récompense à la clé...','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M38\";s:6:\"nombre\";s:1:\"7\";s:6:\"requis\";s:0:\"\";}}',2240,224,350,'','y','g','',0,0,'',1500,6,'oui'),(28,'Araignée des glaces','<à peine est tu rentré dans sa boutique que l\'alchimiste se jette sur toi> Ha! Vous, venez par ici,ça tombe bien. Il me faut quelqu\'un pour aller me récupérer du fil de glace. Du fil de glace !!! comment ça vous ne savez pas ce que c\'est !! voyons c\'est ce fil extrêmement résistant que produisent les araignées des glaces ... il me faut de la matière brute évidemment, provenant directement de la glande... mais ne vous inquiétez pas, si vous acceptez de m\'aider, vous serez sacrément bien payé ! ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M39\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',3200,320,500,'','y','g','',0,0,'',1500,6,'oui'),(29,'Cockatrice','J\'imagine que vous n\'avez jamais vu une cockatrice en face ? Je suppose que non sinon vous ne seriez pas là pour en parler ! C\'est un animal absolument fascinant, donc les facultés de défense sont ... étonnantes !!! En tous cas je suis prêt à payer un bon paquet d\'argent pour avoir un spécimen entre les mains. Histoire de voir si, comme je le pense, les pouvoirs magiques qu\'il possède sont liés à sa glande hyperthyroïdienne... Quoi vous voulez y aller ?? haha vous au moins, vous êtes courageux !!','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M24\";s:6:\"nombre\";s:1:\"4\";s:6:\"requis\";s:0:\"\";}}',2200,240,320,'','y','g','',0,0,'',2800,8,'oui'),(30,'Ogre','Ha vous tombez bien, on a besoin de vos... heu.. talents comme qui dirait. Il s\'agirait d\'aller tanner de l\'ogre cette fois ci... bah blêmissez pas comme ça... oue bon d\'accord, c\'est vrai les ogres c\'est plutôt coton à se coltiner, mais c\'est pour ça qu\'on engage de la piétaille sinon on le ferait nous même hein !! HAHA !!! heu oue enfin bon, toujours est il qu\'on est pas rat avec le danger, et que c\'est sacrément bien payé pour que vous nous débarrassiez de suffisamment de ces saletés... Pourquoi il faut tuer des ogres ?? je t\'en pose des questions moi ?? alors tu prend ou pas ?? ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M29\";s:6:\"nombre\";s:2:\"12\";s:6:\"requis\";s:0:\"\";}}',14400,1200,2000,'','y','g','',0,0,'',3000,9,'oui'),(31,'Roc','On recherche quelques aventuriers confirmés pour aller chasser  un animal extrêmement dangereux, il s\'agit des Rocs, ce sont ces oiseaux qui ressemble à des aigles, mais d\'une envergure bien plus grande ! On recherche plus spécifiquement à se procurer leurs plumes, dont les valeurs dans les composés magiques ne sont plus à prouver... je ne vous cache pas que la tâche est ardue, ces gigantesques volatiles sont capables d\'éventrer un troll... mais à vaincre sans péril ... vous connaissez l\'adage !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M40\";s:6:\"nombre\";s:1:\"6\";s:6:\"requis\";s:0:\"\";}}',3300,336,480,'','y','g','',0,0,'',2800,8,'oui'),(32,'Hydre à trois têtes','il existe des monstres dans les marais qui font trembler même les plus valeureux guerriers... des terreurs sans nom que même les plus puissant mage prennent soins d\'éviter quand ils ont le choix... les hydres font partie de ce genre de monstres... celles qui n\'ont que trois têtes sont les moins dangereuses, et elles représente déjà un adversaire formidable. Aller, admettons que vous soyez capable d\'en défaire quelques unes, cela nous rendrait un fier service, et évidemment cela méritera une bonne prime !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M41\";s:6:\"nombre\";s:1:\"6\";s:6:\"requis\";s:0:\"\";}}',2700,336,400,'','y','g','',0,0,'',2800,8,'oui'),(33,'Cyclopes','régulièrement, certains cyclopes sortent de leur antre afin de venir attaquer des caravanes de marchand, tuant tout ce qu\'ils trouvent sur leur passage... nous recherchons quelques finis lames, ainsi que des mages expérimentés qui soient capable des les affronter pour sécuriser les lignes marchandes. Ce ne sont pas des adversaires qu\'il faut sous-estimer, réfléchissez bien, et si vous souhaitez travailler avec nous, sachez que la prime est des plus satisfaisantes.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M43\";s:6:\"nombre\";s:1:\"9\";s:6:\"requis\";s:0:\"\";}}',7200,1100,2300,'','y','g','',0,0,'',5500,11,'oui'),(34,'Hydre à 5 têtes','L\'hydre à cinq têtes, c\'est un des maîtres des marais... un danger des plus mortels aux alentours, autant dire que pour s\'en débarrasser, on recherche des gens on ne plus compétents dans leur domaine, et dotés d\'un courage inébranlable... et croyez moi vous aurez intérêt à être largement doté des deux pour pouvoir les vaincre si vous acceptez cette mission... la prime sera à la hauteur, pas d\'inquiétude de ce coté là. \r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M45\";s:6:\"nombre\";s:1:\"5\";s:6:\"requis\";s:0:\"\";}}',4500,625,900,'','y','g','',0,0,'',6600,12,'oui'),(35,'Yeti','nous recherchons des gens courageux qui soient à même de partir à la chasse des mythiques yetis... on en trouve quelques uns dans les neiges profondes. Ce sont des créatures intelligentes, et d\'une force exceptionnelle, je vous conseille d\'être on ne peu plus prudent si vous souhaitez partir à la chasse.. ramenez nous leur dépouille et vous toucherez une grosse récompense.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M46\";s:6:\"nombre\";s:1:\"5\";s:6:\"requis\";s:0:\"\";}}',4500,625,900,'','y','g','',0,0,'',6600,12,'oui'),(36,'momie','il existe des créatures anciennes dans le désert, très anciennes, animées par une puissante magie aussi vieille qu\'elles. Ce sont les momies... nous savons assez peu de choses sur elles, et il nous faut des informations de première main afin de savoir quel type de magie les anime. C\'est pour cela que vous êtes là, il nous faut des gens capable de les affronter pour nous ramener les restes afin qu\'on puisse pratiquer des tests sur leurs dépouilles. \r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M27\";s:6:\"nombre\";s:1:\"9\";s:6:\"requis\";s:0:\"\";}}',9500,1350,1959,'','y','g','',0,0,'',8000,13,'oui'),(37,'Ogre à 2 têtes','Vous avez certainement déjà du affronter des ogres... des adversaires coriaces on est d\'accord... mais croyez moi c\'est rien a coté de leur grand frère à deux têtes... je peux vous dire voir ces monstres arracher un arbre pour vous le lancer dessus, c\'est quand même assez dissuasif... mais bon il se trouve que le chef de la garde lui, il dit que la noblaille lui a ordonner de faire le ménage, et du coup on doit trouver le moyen de se débarrasser de quelques unes de ces saloperies. Donc si vous vous sentez assez fort pour pouvoir les affronter, on est en plein recrutement, la prime est royale !!! ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M44\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',12000,2000,2834,'','y','g','',0,0,'',10000,15,'oui'),(38,'Elémentaire d\'air','Salut l\'ami, nous sommes toujours rupture de stock de matériel élémentaire... actuellement nous manquons cruellement d\'air élémentaire qui rentre dans la composition de divers objet, potions et sortilèges. Du coup si vous souhaitez vous faire un bon paquet d\'argent, il vous suffit de partir à la chasse à l\'élémentaire d\'air afin de nous aider a remplir le stock. ','magasin','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M11\";s:6:\"nombre\";s:2:\"20\";s:6:\"requis\";s:0:\"\";}}',27000,3400,6400,'','n','g','',0,0,'',2500,10,'oui'),(39,'Elementaire de terre','Salut l\'ami, nous sommes toujours rupture de stock de matériel élémentaire... actuellement nous manquons cruellement de terre élémentaire qui rentre dans la composition de divers objet, potions et sortilèges. Du coup si vous souhaitez vous faire un bon paquet d\'argent, il vous suffit de partir à la chasse à l\'élémentaire de terre afin de nous aider a remplir le stock. ','magasin','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M50\";s:6:\"nombre\";s:2:\"20\";s:6:\"requis\";s:0:\"\";}}',27000,3400,6400,'','n','g','',0,0,'',2500,10,'oui'),(40,'Elementaire de feu','Salut l\'ami, nous sommes toujours rupture de stock de matériel élémentaire... actuellement nous manquons cruellement de feu élémentaire qui rentre dans la composition de divers objet, potions et sortilèges. Du coup si vous souhaitez vous faire un bon paquet d\'argent, il vous suffit de partir à la chasse à l\'élémentaire de feu afin de nous aider a remplir le stock. ','magasin','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M18\";s:6:\"nombre\";s:2:\"20\";s:6:\"requis\";s:0:\"\";}}',27000,3400,6400,'','n','g','',0,0,'',2500,10,'oui'),(41,'Elementaire d\'eau','Salut l\'ami, nous sommes toujours rupture de stock de matériel élémentaire... actuellement nous manquons cruellement d\'eau élémentaire qui rentre dans la composition de divers objet, potions et sortilèges. Du coup si vous souhaitez vous faire un bon paquet d\'argent, il vous suffit de partir à la chasse à l\'élémentaire d\'eau afin de nous aider a remplir le stock. ','magasin','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M12\";s:6:\"nombre\";s:2:\"20\";s:6:\"requis\";s:0:\"\";}}',27000,3400,6400,'','n','g','',0,0,'',2500,10,'oui'),(42,'Tigre','Rien de tels pour la noblaille que posséder quelques tapis en peau de tigre... mouais, moi je préférais en faire une pelisse bien chaude pour l\'hiver mais hein, comme qui dirait si ils sont prêt à allonger la monnaie... après ils peuvent bien se la mettre ou il veulent la peau de tigre. Enfin bon, je recrute quelques aventuriers expérimentés prêts à affronter quelques tigres pour récupérer leur peau histoire de permettre à un pauvre petit artisan de survivre... la paye ? Comment ça ? .... ha oui bien sur, heu attendez voir ce que je peux vous offrir... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M25\";s:6:\"nombre\";s:2:\"20\";s:6:\"requis\";s:0:\"\";}}',27000,3400,6400,'','n','g','',0,0,'',2500,10,'oui'),(43,'Succubus','J\'ai rencontré une succube une fois... ce sont des êtres fascinants... on est la fois terrifié par leur aspect, et en même temps il se dégage de ces créatures un érotisme troublant qui nous empèche de détourner le regard... et l\'instant d\'après la plupart du temps... on est mort sans même avoir pu réagir. Autant dire qu\'elle représente un grave danger, et il est temps de réagir. Nous recrutons des groupes d\'aventuriers pour exterminer ces démons avant qu\'ils ne causent trop de dommages, ça vous intéresse ? \r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M42\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',16000,2000,3500,'','n','g','',0,0,'',2000,10,'oui'),(44,'Prouve ta valeur','Haha tu te crois fort, mais est ce que tu es capable d\'affronter des élémentaires en combat singulier ? Tiens je suis prêt à te lancer un défi... si tu es capable de vaincre trois élémentaires de chaque famille, je te promet que ton nom s\'élèvera jusqu\'aux plus hautes sphères du royaume, et en plus tu auras une bourse bien remplie.','ecole_combat','a:4:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M11\";s:6:\"nombre\";s:1:\"3\";s:6:\"requis\";s:0:\"\";}i:1;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M12\";s:6:\"nombre\";s:1:\"3\";s:6:\"requis\";s:0:\"\";}i:2;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M18\";s:6:\"nombre\";s:1:\"3\";s:6:\"requis\";s:0:\"\";}i:3;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M50\";s:6:\"nombre\";s:1:\"3\";s:6:\"requis\";s:0:\"\";}}',24000,10000,5500,'','n','s','',0,0,'38;39;40;41',5000,10,'oui'),(46,'Vautours','salut a toi jeune recrue, nous recherchons des aventuriers pour tenter de juguler la population de vautour des environs. Si ca vous interesse, la prime sera substentielle. ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M55\";s:6:\"nombre\";s:1:\"7\";s:6:\"requis\";s:0:\"\";}}',2240,224,350,'','y','g','',0,0,'',1500,6,'oui'),(45,'Scarabés','\"j\'essaye sans arrêt de renouveller mon stock de recettes, histoire de toujours être à la pointe de la gastronomie vous voyez... si on est pas dans le coup dans ce métier on fais pas long feu si vous voyez ce que je veux dire... \r\nEnfin toujours est il qu\'en ce moment je travail sur un sorbet à base de chaire de scarabé... humm succulent... enfin... j\'imagine... parce que j\'ai toujours pas réussi à mettre la main sur une de ces foutues bestioles... donc bon je me disais, voila, si vous êtes motivés, je pourrais vous filer un petit quelque chose si vous parvenez à m\'en ramener une dizaine... \"','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M17\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',1200,90,130,'','y','g','',0,0,'',200,3,'oui'),(47,'Sworling le téléporteur','Lorsque vous vous approchez, ElAndy (Alias Poker plaisir) semble regarder partout autour de lui, l\'air visiblement très énervé.\r\nTiens, toi là, j\'ai l\'impression que tu n\'as pas grand chose à faire, et j\'aimerai que tu t\'occupes d\'un petit truc pour moi.\r\nTu vois ce sac vide à côté de toi ?\r\nIl était rempli de vivres, mais il y a une espèce de petit lutin tout vert et presque aussi frêle que toi qui viens de me le vider à l\'instant.\r\nC\'est la troisième fois qu\'il me fait le coup. Il apparait de nulle part, me prend ma bectance, et se barre aussi sec.\r\nJ\'ai autre chose à foutre que de le rattraper, mais si tu arrives à lui donner une bonne leçon, je veux bien te récompenser.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M56\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}}',1,1,1,'','y','s','',0,0,'',0,1,'oui'),(48,'Le réveil des ents','\"Vous là, venez par ici. Hum, on dira que vous ferez l\'affaire, on a un problème majeur, les esprits qui animent les anciens arbres de la forêt ont été corrompus par une force inconnue. ces puissances de la nature se sont éveillées et marchent contre nous... Il faut les stopper avant qu\'ils ne causent plus de dommages !! Il faut que vous nous aidiez à les stopper. Allez y avec une équipe solide et taillez votre route à la force de la hache et de vos sortilèges... \r\nSoyez certains que la récompense compensera le danger encouru.\" ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M54\";s:6:\"nombre\";s:2:\"20\";s:6:\"requis\";s:0:\"\";}}',27000,3500,6500,'','n','g','',0,0,'',2800,10,'oui'),(49,'A la recherche d\'informations','Comme vous le savez peut être, la cité de Myriandre a été attaquée il y a quelques temps par le dragon fou Arderax, qui l\'a réduite en cendres. Nous souhaitons engager quelques aventuriers courageux pour une mission de reconnaissance afin déterminer si la cité a été complètement détruite. De plus certains rapports font mentions de phénomènes étranges qui se produiraient dans les environs, apparitions et autres fadaises du même genre. Nous souhaitons que vous enquêtiez sur ces rapports et nous rapportiez tout ce qui peut sortir de l\'ordinaire dans ce genre de situation.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"L27\";s:6:\"nombre\";i:1;s:6:\"requis\";s:0:\"\";}}',0,0,0,'','n','s','10;9;1;8;6;3',4,0,'',0,4,'non'),(50,'Parler à Dryasaïde','J\'ai parcouru ce journal, tout ça est très étrange, il nous faut l\'avis d\'un spécialiste sur le sortilège qui y est décrit. Vous devez vous rendre dans la forêt de Loch\'jaeden en quête d\'un mage du nom de Drysaïde, peut être pourra-t-il vous en apprendre plus.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"P12\";s:6:\"nombre\";i:1;s:6:\"requis\";s:0:\"\";}}',0,0,0,'','n','s','10;9;1;8;6;3',0,0,'49',0,0,'non'),(51,'De quoi tu es capable','Tuer pleins de monstres','','a:6:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M1\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}i:1;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M32\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}i:2;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"M3\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}i:3;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M33\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}i:4;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M17\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}i:5;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M34\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}}',0,0,0,'','n','s','',0,0,'',0,0,'non'),(52,'De quoi tu es capable suite','Tuer 6 joueurs énnemis à votre race','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:2:\"J9\";s:6:\"nombre\";i:6;s:6:\"requis\";s:0:\"\";}}',0,0,0,'','n','g','',0,0,'51',1,0,'non'),(53,'De quoi tu es capable fin','Ramener une potion de vie mineure et une baguette de sureau sloté et un parchemin','','a:3:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"Oo4\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}i:1;O:8:\"stdClass\":3:{s:5:\"cible\";s:4:\"Oo14\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}i:2;O:8:\"stdClass\":3:{s:5:\"cible\";s:6:\"Oa42s1\";s:6:\"nombre\";s:1:\"1\";s:6:\"requis\";s:0:\"\";}}',0,0,0,'','y','s','',0,0,'52',0,0,'non'),(54,'Chasse aux Basilics','Bon on a un gros problème, notre équipe de Dodgeball c\'est faite dévorer lors de leur entrainement nocturne en forêt. Quelle idée aussi ! Donc pour calmer la league et les supporter on lance une grande battue, chaque équipe doit ramener autant de basilics que de nos amis dévorés ! Good Hunt !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M47\";s:6:\"nombre\";s:1:\"8\";s:6:\"requis\";s:0:\"\";}}',16000,2048,4584,'','y','g','',0,0,'',10240,16,'oui'),(55,'Ramener mes Lampes !','Yalla mon frère !\r\nJ\'ai perdu mon chargement de lampes magiques dans le désert, alors vous me les ramenez rapidos avant que les djinns n\'en sortent, sinon va falloir abattre ces démons !','magasin','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M28\";s:6:\"nombre\";s:2:\"15\";s:6:\"requis\";s:0:\"\";}}',38000,4860,10834,'','y','g','',0,0,'',12960,18,'oui'),(56,'une étrange mutation','\"certains scarabées géants ont été frappés d\'une étrange mutation, qui les a rendu beaucoup plus gros, et de facto plus résistants, plus forts, et aussi beaucoup plus vicieux. \r\nNous devons découvrir d\'où provient ce phénomène, malédiction, évolution naturelle ou encore autre chose... allez savoir. \r\nIl va nous en falloir une certaine quantité afin de pouvoir mener une étude exhaustive\"','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M76\";s:6:\"nombre\";s:2:\"12\";s:6:\"requis\";s:0:\"\";}}',11500,1452,3334,'','y','g','',10,50,'45',4840,11,'oui'),(57,'bandits de grand chemin','\"Nous avons noté une recrudescence inquiétante d\'attaques sur les marchands et voyageurs le long des routes qui conduisent à la ville. Nous pensons qu\'elles sont l\'oeuvre de groupes de pillards bien organisés et entrainés, aussi je vous demande d\'être prudent si vous décidez d\'accepter cette mission et d\'aller leur expliquer gentiment qu\'il va falloir penser a une reconversion immédiate...\" ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M77\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',9600,1210,2792,'','y','g','',10,50,'',4840,11,'oui'),(58,'la révolte gronde ','Nous devons faire face a des attaques de centaures de plus en plus fréquentes..., ce qui a commencé par quelques petites escarmouches sans conséquences se transforme en guérilla sanguinaire, et nous ne pouvons plus nous permettre de fermer les yeux. Pendant que nos diplomates tentent de régler le problème, il faut que vous interveniez afin de leur faire passer le message de façon plus ... hum ... terre à terre... \r\net surtout sachez rester discrets pour cette fois. Le code mission sera double zéro.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M78\";s:6:\"nombre\";s:2:\"11\";s:6:\"requis\";s:0:\"\";}}',11000,1331,3000,'','y','g','',10,50,'',4840,11,'oui'),(59,'une mission facile','Ha vous tombez bien, venez par ici, j\'ai une mission on ne peut plus facile a vous confier... une formalité rien de plus, vous allez voir. \r\nIl s\'agit juste de vous rendre dans la forêt et de venir a bout de quelques cochons... une rigolade pour quelqu\'un de votre envergure. \r\nComment ça ? quel type de cochons ? et bien ... heu .. ce sont ceux qu\'on appel les Phacochère rieurs... mais ne vous inquiétez pas, on a beaucoup surestimé leur capacités ces derniers temps... mais pour quelqu\'un de votre trempe, ça ne devrait pas poser de problème n\'est ce pas, ce n\'est pas un cochon qui va vous faire peur... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M79\";s:6:\"nombre\";s:2:\"13\";s:6:\"requis\";s:0:\"\";}}',15000,1872,3000,'','y','g','',12,500,'',5760,12,'oui'),(60,'les éclaireurs','Ecoutez moi bien, nous pensons que la recrudescence dans l\'activité des goblins dans les montagnes cache une attaque de plus grande envergure. Vous avez réussi à les ralentir en tuant un grand nombre de leurs soldats, et pour cela nous vous félicitons. Mais si vous voulez vraiment nous aider a les endiguer pendant que nous préparons une riposte adaptée, il va falloir que vous vous attaquiez à leurs chefs, les hobgoblins. Ils sont plus grands et plus vicieux, mais je ne doute pas qu\'un aventurier tel que vous puisse en venir à bout avec un peu de pérsévérance.  ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M80\";s:6:\"nombre\";s:2:\"15\";s:6:\"requis\";s:0:\"\";}}',18000,2535,5834,'','y','g','',12,500,'19',6760,13,'oui'),(61,'la révolte gronde ( suite )','Vous avez effectué un bon travail pour nous en nous débarassant de quelque uns de ces demi-hommes, mais nous avons encore besoin de vos \'talents\'. Nous avons découverts que les centaures sont grandement influencés dans cette révolte par leur ainés, les centaures des neiges qui vivent dans les glaces. Nous vous demandons, officieusement bien sur, d\'aller mettre un terme aux... hum... conseils belliqueux qu\'ils donnent à leurs cousins... veillez à ce qu\'ils aient bien compris le message... \r\net comme toujours, si vous ou l\'un de vos hommes venez a être capturés, nous nierons avoir eu connaissance de vos agissements.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M81\";s:6:\"nombre\";s:2:\"13\";s:6:\"requis\";s:0:\"\";}}',18000,2197,5000,'','y','g','',12,500,'',6760,13,'oui'),(62,'les légions démoniaques','certains démons parviennent à se faufiler depuis leur dimension démoniaque jusque dans notre monde... Que ce soit le résultat d\'une invocation ratée, ou d\'un phénomène naturel, ou par un portail démoniaque, ces entités n\'ont qu\'une idée en tête, provoquer la destruction et disséminer la terreur parmi les mortels... \r\nNous ne pouvons bien évidemment pas les laisser errer à leur guise. \r\nC\'est pourquoi nous offrons des récompenses pour les aventuriers suffisamment courageux et capables pour les affronter et les renvoyer d\'où ils viennent avant qu\'ils n\'aient causé trop de dommages. \r\nPour le moment vous n\'aurez à vous occuper que de la piétaille, les plus faibles des démons, auquel on a accordé le grade de cercle cinq. ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M82\";s:6:\"nombre\";s:2:\"16\";s:6:\"requis\";s:0:\"\";}}',24000,3136,7084,'','y','g','',13,800,'',7840,14,'oui'),(63,'les âmes damnées','Les mages les plus puissants ne peuvent souvent supporter d\'être finalement vaincus par le terrible des ennemis, la vieillesse... ils passent souvent leurs dernières années a tenter de s\'y soustraire par n\'importe quel moyen, et cela peut tourner a l\'obsession. Mais rare sont ceux à parvenir à un réel résultat, tout ce qu\'ils obtiennent est un simulacre de vie, ni vivants ni morts, ils survivent sous une forme abominable pire que la mort elle même, toujours aussi avide de pouvoir, et aigris contre les vivants. On les nomme des Liches et ce sont des adversaire redoutables qui doivent être éliminés une bonne fois pour toute... \r\nLa confrontation avec ces dangers innommables est si périlleuse que je ne vous proposerais cette mission qu\'une seule fois... mais si vous réussissez, croyez moi, on entendra parler de vous !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M83\";s:6:\"nombre\";s:2:\"14\";s:6:\"requis\";s:0:\"\";}}',22000,10000,10417,'','n','g','',14,38400,'',9000,14,'oui'),(64,'les maïtres de la fourmillière','Vous avez fait du bon travail pour nous en réduisant la population de fourmis ouvrières puis soldats. Les effets de notre politique de riposte sont déjà visible. \r\nIl s\'agit désormais de passer à l\'étape au dessus et de porter un coup directement aux fourmis dirigeantes. \r\nJe veux parler des Myrmarques formiens, ils sont considérablement plus forts et plus résistants que les autres membres de leur espèce, aussi je vous conseille la plus grande prudence quand vous déciderez de les affronter. ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M84\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',16000,1960,4334,'','y','g','',13,800,'',8000,14,'oui'),(65,'réalité d\'un cauchemar','les Onikage forme une espèce à part, qui se nourrit des cauchemars qu\'ils infligent à leur victime... \r\nle plus souvent, ils n\'ont même pas besoin de combattre, leur proie attendant la mort comme une délivrance... \r\nIls n\'en sont pas moins extrêmement puissant, et nous cherchons des gens non moins expérimenter afin de les affronter et de nous délivrer du danger qu\'ils représentent. \r\nSoyez prêt à faire preuve d\'une détermination hors du commun si vous acceptez cette mission, et prenez garde à vos arrières, ce sont des adversaires fourbes qui aiment utiliser l\'effet de surprise. ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M85\";s:6:\"nombre\";s:1:\"9\";s:6:\"requis\";s:0:\"\";}}',16000,2025,4500,'','y','g','',13,5000,'',9000,15,'oui'),(66,'Chasseurs de peaux','Il faut que vous nous débarrassiez de ces guerriers présomptueux qui se font appeler les chasseurs de peaux. Ils osent défier notre autorité et provoquent des escarmouches avec certains les nôtres dès qu\'ils en ont l\'occasion. Il est de leur faire comprendre qui dirige dans le coin. \r\nEt surtout faites leur bien savoir qui vous envois... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M86\";s:6:\"nombre\";s:2:\"12\";s:6:\"requis\";s:0:\"\";}}',21600,3000,6417,'','y','g','',13,5000,'',9000,15,'oui'),(67,'l\'aiguille écarlate','les scorpions géants sont porteurs d\'une mort aussi certaine que douloureuse pour ceux qui ne les approchent pas avec la plus grande prudence, et pourtant la glande qui contient leur poison se révèle être des plus recherchées par les éminences guérisseuses de notre royaume. C\'est pourquoi quelques braves au coeur bien accroché sont engagés pour tenter d\'en vaincre quelques uns contre une forte récompense.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M87\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',20600,2560,5834,'','y','g','',14,9600,'10',10240,16,'oui'),(68,'mefiez vous de l\'eau qui dort','Vous avez peut être déjà pu observer ces monstres, flottant à la surface de quelque mare ou d\'une rivière. ils restent a proximité des rives, guettant leur proie avec patience. Qui pourrait croire qu\'une telle masse puisse se déplacer avec autant de vivacité ? il y a quelques jours, tout un groupe de soldats a encore été décimé par deux de ces mastodontes... Il est temps que cela cesse. Nous devons tout mettre en oeuvre pour réduire le danger posé par ces monstres. Si vous acceptez cette mission, vous devrez vous rendre dans les plaines où ils résident afin de les exterminer une fois pour toutes.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M88\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',20600,2560,5834,'','y','g','',14,9600,'59',10240,16,'oui'),(69,'la menace volante','Les wyvernes sont apparentés à la famille des dragons... mais heureusement pour vous, c\'est plutôt la branche dégénérée de la famille... en tous ils sont loins d\'avoir l\'intelligence de leurs cousins draconides... mais ne vous y trompez pas, ils restent des adversaires redoutables et redoutés. Si vous décidez de les affronter, surtout faites attention à leurs griffes empoisonnées... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M89\";s:6:\"nombre\";s:2:\"11\";s:6:\"requis\";s:0:\"\";}}',24000,3179,7198,'','y','g','',14,9600,'',11560,17,'oui'),(70,'l\'appel de la mort','Parfois, après le crépuscule, quand la brume s\'épaissit, on peut l\'observer au loin, errant à la recherche d\'une âme à capturer... On la rencontre sous la forme d\'une belle jeune fille au visage dévoré par les pleurs ou au contraire d\'une vieille femme hideuse aux longs et maigres cheveux, vêtue d\'une robe verte et d\'un manteau gris.\r\nElle est porteuse d\'une sombre malédiction, et on dit que c\'est de la mort elle même qu\'elle tire sa puissance. Soyez extrêmement prudent si vous la combattez, si le voile de son pouvoir s\'étend jusqu\'à  votre âme... ce sera votre fin !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M90\";s:6:\"nombre\";s:2:\"17\";s:6:\"requis\";s:0:\"\";}}',21010,2601,5834,'','y','g','',14,9600,'',11560,17,'oui'),(71,'corruption elfique','Certains disent qu\'il n\'y a pas plus pur que le coeur d\'un elfe... ces gens là n\'ont jamais croisé le peuple des elfes noirs. Une vieille légende dit qu\'ils ont abusé de la magie du sang par le passé, et que leur âme ainsi que leur coeur sont à jamais perdus pour le monde de la lumière. Aujourd\'hui ils errent dans des souterrains sombres et profonds, tramant des complots, fourbissant leurs armes et leur magie. Leur but ? pouvoir et destruction mon ami, pouvoir et destruction...','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M91\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',26000,3240,7334,'','y','g','',15,9600,'',12960,18,'oui'),(72,'Chair de chitineux','On recherche des aventuriers courageux capables de vaincre ces abominables monstres que représentent les chitineux. Vous n\'avez pu manquer ce les apercevoir, ils sont gigantesques, et aussi forts que résistants, protégés par une armure épaisse et quasiment sans faille... il vous faudra toute votre ruse et votre habileté pour vous défaire d\'un tel adversaire si acceptez cette mission... et n\'oubliez pas de rapporter leur chair, ses propriétés autant magiques que gustatives valent une fortune.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M92\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',29000,3610,7917,'','y','g','',15,9600,'',12960,18,'oui'),(73,'Licornes','Les licornes, ces animaux rares et merveilleux, possèdent un appendice occipital aux particularités étonnantes, dans la mesure où leur corne réduite en poudre possèderait des capacités... enfin... vous comprenez... fertilisantes, vivifiantes... Si vous pouviez nous en procurer quelques-unes, la récompense serait à la hauteur de la tâche. Cependant, méfiez-vous car ces créatures peuvent se relever alors même que vous pourriez les croire mortes...','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M93\";s:6:\"nombre\";s:2:\"11\";s:6:\"requis\";s:0:\"\";}}',30000,3971,8974,'','y','g','',16,9600,'',36000,19,'oui'),(74,'Les sabots de l\'enfer','Avez-vous eu vent des disparitions de plusieurs expéditions dans les montagnes avoisinantes ? Vous nous aviez déjà débarrassé des gobelins et de leurs chefs plus hardis, les hobgobelins, causes des précédentes affaires. Cette fois-ci c\'est sérieux, d\'autant plus que nous n\'avons guère de piste, si ce n\'est d\'étranges traces fumantes de sabots dans la neige, et quelques témoins de peu de foi prétendant avoir aperçu d\'étranges yeux rouges dans la nuit. Faites votre possible pour ramener le calme dans la région et nous saurons nous montrer généreux.\r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M94\";s:6:\"nombre\";s:1:\"9\";s:6:\"requis\";s:0:\"\";}}',24000,3249,7342,'','y','g','',16,9600,'',36000,19,'oui'),(75,'Gorgone ','N\'avez-vous pas vu ces champs de statues en ruine aux abords de la cité ? On dit que les gorgones sont sorties de leurs ancestrales tanières, et que leur regard pétrifie tous ceux qui le croisent. Il faut absolument que vous éradiquiez la menace qui pèse sur la contrée. N\'hésitez pas à employer tous les moyens à votre disposition pour cela.\r\nSi vous étiez amené a croiser leur chef : Zola... prenez garde, on dit qu\'elle n\'est pas très coulante !\r\n','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M99\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',33000,4410,10000,'','y','g','',18,18000,'',45000,21,'oui'),(76,'anciens de la forêt','Ce n\'est pas des créatures magiques que nous vous envoyons affronter cette fois... c\'est contre la forêt elle même que vous devrez vous battre. Les lianes chasseresses sont parmis les plus anciens gardiens du coeur vert... elles n\'ont pas de notions de bien ou de mal, même si pour nous elles peuvent sembler cruelles. Ce sont des chasseuses impitoyables, et c\'est elle que vous devrez vaincre si vous voulez la récompense.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M98\";s:6:\"nombre\";s:1:\"8\";s:6:\"requis\";s:0:\"\";}}',26000,3520,8000,'','y','g','',19,18000,'48',45000,21,'oui'),(77,'Martichoras','Les montagnes sont remplies de nombreuses créatures qui restent tapies, guettant l\'aventurier audacieux qui ne sera pas assez sur ses gardes. Mais de tous ces dangers, certains sont plus mortels que d\'autres... Car la manticore ne se bat pas pour défendre son territoire.. ou ses petits. Son nom signifie la mangeuse d\'hommes... Elle tue pour le plaisir, ou au nom d\'une vengeance ancestrale... Toujours est il que vous ne l\'entendrez pas venir. Lorsque vous saurez qu\'elle est là, il sera surement trop tard... bonne chance !','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M48\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',30000,4000,9040,'','y','g','',18,11500,'',40000,20,'oui'),(78,'Succubus ','Je sais que vous avez affronté des sucubes mineures par le passé... Un glorieux exploit je le sais. Mais qui n\'est rien comparé a celui qui vous attend si vous decidez d\'affronter leurs ainées. Elle sont plus grandes, plus rapides, plus résistantes et leur maitrise des arts noirs fait passer leur petites cousines pour des prestidigitateurs du dimanche... \r\nVous êtes toujours partant ? courageux ! ou suicidaire diraient certains... bonne chance compadre.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M96\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',30000,4000,9000,'','y','g','',18,9600,'43',40000,20,'oui'),(79,'Serpent a plumes','Les serpents a plumes font partis de la famille des dragons. Même s\'ils restent bien plus faibles que leurs grand cousins, ils sont quand même très puissants. Ils se nichent dans des grottes sous les sables du désert, chassant a l\'occasion, et orchestrant le reste du temps des complots visant l\'accomplissement de quelque dessein qui leur est propre... \r\nLe trophée qu\'ils représentent vaut une fortune royale, et c\'est pour cela que vous serez payé non moins royalement, vous pourrez conserver tout trésor que vous trouveriez bien entendu...','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M95\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',30000,4000,9000,'','y','g','',18,11000,'',40000,20,'oui'),(80,'Abomination','Vous l\'entendez parfois... quand le vent est tellement fort que même les murs de pierre tremblent. Certains shamans pensent qu\'il est l\'incarnation physique des éléments déchainés, d\'autres que c\'est une créature des abysses, lachée sur le monde en ravager la beauté...\r\nSi vous vous mettez en chasse, n\'oublier pas de faire votre testament l\'ami.. ce n\'est qu\'une idée comme ça... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:3:\"M97\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',30000,4000,9000,'','y','g','',17,11000,'',40000,20,'oui'),(81,'un cri dans la nuit','Vous l\'entendez parfois... au coeur de la nuit, un hurlement perçant qui vous glace le sang.\r\nIls errent dans les marais et dans les terres ravagées dont ils sont issues, mais on les croisent parfois dans des endroits plus inattendus...\r\nIl faut que vous en éliminiez quelques uns pour passer l\'envie aux autres de quitter leur antre... enfin si vous êtes capable de maitriser vos peurs les plus enfouies... car le hurleur saura les réveiller...','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:4:\"M100\";s:6:\"nombre\";s:1:\"9\";s:6:\"requis\";s:0:\"\";}}',30000,4356,10000,'','y','g','',19,18000,'',50000,22,'oui'),(84,'Les harpies','les harpies vivent au coeur des pics montagneux, ce sont des êtres plein de rancune, qui recherchent la vengeance car elles sont issues d\'une vieille malédiction à l\'encontre de leur race... Mais ne vous y trompez pas, elles sont capables de fondre sur vous en un éclair et de vous tailler en pièces aussi sec, ce sont des guerrières redoutables... \r\nC\'est une bourse pleine de pièces d\'or qui vous attend si vous décidez de nettoyer les montagnes de ce danger pour quelques temps.','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:4:\"M102\";s:6:\"nombre\";s:2:\"11\";s:6:\"requis\";s:0:\"\";}}',37000,5324,12000,'','y','g','',19,18000,'',50000,22,'oui'),(83,'Lézards Voltaïque','ha l\'ami, je te souhaite de ne jamais en croiser un... ce ne sont que des animaux, mais ils ont un genre d\'intelligence... vicieuse et cruelle, et ils savent maitriser un genre de magie basée sur l\'électricité... rapides, forts, et malins. Une combinaison mortelle l\'ami, qu\'il vous faudra vaincre si vous voulez toucher la récompense juteuse... ','','a:1:{i:0;O:8:\"stdClass\":3:{s:5:\"cible\";s:4:\"M101\";s:6:\"nombre\";s:2:\"10\";s:6:\"requis\";s:0:\"\";}}',33800,4840,10900,'','y','g','',19,18000,'',50000,22,'oui');
