-- Table structure for table `sort_combat`
--

DROP TABLE IF EXISTS `sort_combat`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `sort_combat` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `nom` varchar(50) NOT NULL default '',
  `description` text NOT NULL,
  `mp` mediumint(8) unsigned NOT NULL default '0',
  `type` varchar(50) NOT NULL default '',
  `comp_assoc` varchar(50) NOT NULL default '',
  `carac_assoc` varchar(50) NOT NULL default '',
  `carac_requis` mediumint(9) unsigned NOT NULL default '0',
  `incantation` mediumint(8) unsigned NOT NULL default '0',
  `comp_requis` mediumint(9) NOT NULL default '0',
  `effet` varchar(50) NOT NULL default '',
  `effet2` float unsigned NOT NULL default '0',
  `duree` tinyint(3) unsigned NOT NULL default '0',
  `cible` tinyint(4) NOT NULL default '0',
  `requis` text NOT NULL,
  `prix` int(11) NOT NULL default '0',
  `difficulte` int(11) NOT NULL default '0',
  `lvl_batiment` tinyint(3) unsigned NOT NULL default '0',
  `etat_lie` varchar(30) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=178 DEFAULT CHARSET=utf8;
SET character_set_client = @saved_cs_client;

